UPDATE `npc_text` SET `text1_1` = '$n! I''ve been wondering how you were. What''s kept you?',`text2_1` = 'I trust you''re taking every precaution....$b$bThis is a dangerous place and I couldn''t forgive myself if something were to happen to you.',`text3_1` = 'We must hurry, $n. Malygos'' ruinous plans will soon be irreversible.',`text4_1` = 'In times such as these, dear friends are invaluable.$b$bBe safe, $n. As safe as one can be in a place like this....',`text5_1` = 'If you hadn''t rescued me from that prison I surely would have succumbed by now.$b$bI have not forgotten....',`text6_1` = 'When our duty here is behind us, I shall find a way to repay you for my rescue.',`text7_1` = 'My strength is returning, slowly....$b$bI hope to be able to show you the glory of my true form soon.' WHERE `ID` = 12576;
UPDATE `npc_text` SET `text7_0` = 'Don''t forget to stock up on wrapping paper this holiday season!  Nothing says "Wondrous Winter Veil" like wrapped armors and weapons for your friends and family.', `text7_1` = 'Don''t forget to stock up on wrapping paper this holiday season!  Nothing says "Wondrous Winter Veil" like wrapped armors and weapons for your friends and family.' WHERE `ID` = 6194;
UPDATE `npc_text` SET `text6_0` = 'What does "zug zug" mean?' WHERE `ID` = 6993;
UPDATE `npc_text` SET `text1_0` = 'You can understand me? I can understand you!', `text2_0` = '$R, why would I want to talk to you? Your people probably caused this mess in the first place!', `text3_0` = 'There are clams to be collected and orcas to be killed. Help or stay out of the way!', `text4_0` = 'Blurglgr murbrgl... just kidding, I can understand you.', `text5_0` = 'You figure out yet why our brothers and sisters over in the village have gone insane?', `text6_0` = 'I knew that we never should have gone into those caves. It''s not natural!', `text7_0` = 'There''s something fishy about new King Mrgl-Mrgl, but I can''t quite put my finger on it.' WHERE `ID` = 12363;
UPDATE `npc_text` SET `text0_0` = 'What''s that $T scrub : girlie;?  You want your mommy?  Well too bad.  Maybe you should pay a visit to the Thrallmar officer''s club to get her back?', `text1_0` = 'Do you know where you are?  This is Honor Hold, sweetheart!  Love it or get out!', `text2_0` = 'This isn''t a field trip, maggot!  You''re in the Outland now!  Shape up or take a stroll back through the portal.', `text3_0` = 'I have neither the time, nor the inclination, to explain things to you, scumbag!  Now do you have something important to say, or are you just here to ask me out for a drink, princess?', `text4_0` = 'What is your major malfunction?!', `text5_0` = 'I''ve seen you prancing around.  Why don''t you do us all a favor and just drop your gear off at the armory?', `text6_0` = 'Who in name of Kurdran let you through the Dark Portal?', `text7_0` = 'Well, well, well, what have we here?  A $T civilian : civilian;?  Isn''t that precious?  You''ll get no special treatment from me!' WHERE `ID` = 8961;
UPDATE `npc_text` SET `text7_0` = NULL WHERE `ID` IN (8934,3297,7530,7635,7669,8061,8480,8484);
