UPDATE `npc_text` SET `text1_0` = 'That no good kiss-up is probably practicing ballet in his chambers.', `text2_0` = 'NEVER say that name around me! Consider this your one and only warning!', `text3_0` = 'I can tell you where he''s not...', `text4_0` = 'Heigan is probably performing maintenance on his slime and crap filled dance studio.' WHERE `ID` = 13396;
