UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Pleased to meet you! I''m Gidge, the resident spellfire tailoring expert here in Shattrath. Not that there''s any competition, but if you''re interested in learning to be a spellfire tailor and haven''t settled on a specialization, I can help.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL WHERE `ID` = 10671;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Oh, no!  My Fei Fei would never take someone else''s things!  He''s a good dog... he just needs attention sometimes.  If you give him a treat, then you see!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL WHERE `ID` = 10689;
