UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = '<Angela coos to the felhunter again before turning her attention to you.>$B$BJir''see''s always been smaller than all the other felhunters, but that''s never bothered him. And Outland''s going to change all that, right Jir''see?$B$BMomma''s little angel is going to grow up to be a big, fierce felhunter, yes he is!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL WHERE `ID` = 10934;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Do you need something, $c?  Perhaps I can assist you.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL WHERE `ID` = 8858;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'The Defenders of Blood Watch protect this outpost from any threat. ',`text1_0` = NULL,`text1_1` = 'The Defenders are here to protect Blood Watch from the Sunhawk threat. ',`text2_0` = NULL,`text2_1` = 'We''ve recently heard word of a creature of immense power being summoned near the Vector Coil. Fear not, should anything threaten the town, we will give our lives to protect it.' WHERE `ID` = 9206;
UPDATE `npc_text` SET `text0_0` = 'With the sanction of Lady Sylvanas, the Deathstalkers'' numbers grow. More blades to strike at our enemies when they least expect it.',`text0_1` = 'With the sanction of Lady Sylvanas, the Deathstalkers'' numbers grow. More blades to strike at our enemies when they least expect it.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 581;
UPDATE `npc_text` SET `text0_0` = 'Naralex sleeps again!$b$bLong ago, Naralex journeyed to this cavern with the honorable goal of entering the Emerald Dream and regrowing the Barrens into a lush forest. His focus waned and his thoughts became tainted by serpentine visions.$b$bNow, reptilian beasts seep from his dreams to the land. He must be awoken from the nightmare or he will be forever lost, and a great evil unleashed.$b$bOnly after his corrupted servants, the Fanglords, have been slain can I perform the awakening ritual.$B$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 698;
UPDATE `npc_text` SET `text0_0` = 'Thorfin Stoneshield came to us all the way from Ironforge to bring us his expertise in hunting.  If you don''t mind breathing the smoke filled air of the Dwarven District then you''ll find him at his house in the northeast area of the district.',`text0_1` = 'Thorfin Stoneshield came to us all the way from Ironforge to bring us his expertise in hunting.  If you don''t mind breathing the smoke filled air of the Dwarven District then you''ll find him at his house in the northeast area of the district.',`text1_0` = 'A Hunter is it?  Well, then you will want to speak with Thorfin Stoneshield over in the Dwarven District.  $B$BOh, and you be sure to tell him that if I step in his pet''s business one more time, he''s going to be training other hunters from behind bars in the Stockade!',`text1_1` = 'A Hunter is it?  Well, then you will want to speak with Thorfin Stoneshield over in the Dwarven District.  $B$BOh, and you be sure to tell him that if I step in his pet''s business one more time, he''s going to be training other hunters from behind bars in the Stockade!',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 905;
UPDATE `npc_text` SET `text0_0` = 'What? I don''t know of any warlock trainers in Stormwind. $B$BAlthough... There have been some sightings of demonic activity over by The Slaughtered Lamb in the Mage Quarter. I suppose you could check there.',`text0_1` = 'What? I don''t know of any warlock trainers in Stormwind. $B$BAlthough... There have been some sightings of demonic activity over by The Slaughtered Lamb in the Mage Quarter. I suppose you could check there.',`text1_0` = 'Warlocks, eh.  Well, you didn''t hear it from me, but I''ve heard rumors that those types gather at a bar called the Slaughtered Lamb in the Mage Quarter.  ',`text1_1` = 'Warlocks, eh.  Well, you didn''t hear it from me, but I''ve heard rumors that those types gather at a bar called the Slaughtered Lamb in the Mage Quarter.  ',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 906;
UPDATE `npc_text` SET `text0_0` = 'If you are looking to become a great cook, venture over to the Pig and Whistle Tavern in Old Town and talk to Stephen Ryback. That man knows how to cook up a rack of ribs like no other.$B$BMan... now you got me hungry for some of his famous ribs. Don''t count on him teaching you that recipe though!',`text0_1` = 'If you are looking to become a great cook, venture over to the Pig and Whistle Tavern in Old Town and talk to Stephen Ryback. That man knows how to cook up a rack of ribs like no other.$B$BMan... now you got me hungry for some of his famous ribs. Don''t count on him teaching you that recipe though!',`text1_0` = 'There''s a great cook who works at the Pig and Whistle Tavern in Old Town.  I''ve watched him use a knife when he cooks and just between you and me, I don''t think he''s always been a cook.  Don''t get me wrong... if you still want to learn, he''s the best we have.',`text1_1` = 'There''s a great cook who works at the Pig and Whistle Tavern in Old Town.  I''ve watched him use a knife when he cooks and just between you and me, I don''t think he''s always been a cook.  Don''t get me wrong... if you still want to learn, he''s the best we have.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 921;
UPDATE `npc_text` SET `text0_0` = 'Stormwind''s resident engineer trainer is an ingenious gnome by the name of Lilliam Sparkspindle. He can be found in the back of the Dwarven District.',`text0_1` = 'Stormwind''s resident engineer trainer is an ingenious gnome by the name of Lilliam Sparkspindle. He can be found in the back of the Dwarven District.',`text1_0` = 'Hey, that reminds me, I need to have my rocket boots repaired.  Word to the wise my friend, rocket boots and gryphons don''t mix.  $B$BOh, but you need directions...  just head on over to the Dwarven District, you''ll find Lilliam Sparkspindle towards the back.',`text1_1` = 'Hey, that reminds me, I need to have my rocket boots repaired.  Word to the wise my friend, rocket boots and gryphons don''t mix.  $B$BOh, but you need directions...  just head on over to the Dwarven District, you''ll find Lilliam Sparkspindle towards the back.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 922;
UPDATE `npc_text` SET `text0_0` = 'The Cathedral of Light is the center of all the healing practices of Stormwind. There you can find Shaina Fuller to help you learn this craft.',`text0_1` = 'The Cathedral of Light is the center of all the healing practices of Stormwind. There you can find Shaina Fuller to help you learn this craft.',`text1_0` = 'No better place to learn First Aid than under the watchful eye of Shaina Fuller at the Cathedral of Light.  $B$BTo get there, just look for the yellow rooftops, or the towering spire of the Cathedral itself which you can see from almost anywhere in the city.',`text1_1` = 'No better place to learn First Aid than under the watchful eye of Shaina Fuller at the Cathedral of Light.  $B$BTo get there, just look for the yellow rooftops, or the towering spire of the Cathedral itself which you can see from almost anywhere in the city.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 923;
UPDATE `npc_text` SET `text0_0` = 'You are gonna want to head over to Old Town and drop by the Protective Hide if you are lookin'' to learn skinning.',`text0_1` = 'You are gonna want to head over to Old Town and drop by the Protective Hide if you are lookin'' to learn skinning.',`text1_0` = 'You know, I could run an orc through or slice up a troll? I could even carve my initials in an ogre''s flank, but I just can''t stand to skin an animal.  Go figure, eh.  $B$BWell, if you have the stomach for it, then go see Maris Granger at the Protective Hide in Old Town.',`text1_1` = 'You know, I could run an orc through or slice up a troll? I could even carve my initials in an ogre''s flank, but I just can''t stand to skin an animal.  Go figure, eh.  $B$BWell, if you have the stomach for it, then go see Maris Granger at the Protective Hide in Old Town.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 928;
UPDATE `npc_text` SET `text0_0` = 'Nothing like spending a day down at Crystal Lake fishing. Arnold Leland is the man that taught me. You can usually find him out on the dock in the Canal District just fishing the day away. $B$BOh, and don''t believe any of the stories he tells you about monsters in the canals either.',`text0_1` = 'Nothing like spending a day down at Crystal Lake fishing. Arnold Leland is the man that taught me. You can usually find him out on the dock in the Canal District just fishing the day away. $B$BOh, and don''t believe any of the stories he tells you about monsters in the canals either.',`text1_0` = 'That bum Leland... all he does is sit out on the dock outside the Trade District and fish all day.  I sure hope he''s good at it for all the time he spends fishing.  If you want to learn, why don''t you go talk to him?',`text1_1` = 'That bum Leland... all he does is sit out on the dock outside the Trade District and fish all day.  I sure hope he''s good at it for all the time he spends fishing.  If you want to learn, why don''t you go talk to him?',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 940;
UPDATE `npc_text` SET `text0_0` = 'Yes, I have seen the shaman you seek. Last I saw her, she was to the west of here. She hides in the hills above the Razormane tribe. If you''re clever, you''ll be able to find a path to her hut in the hills. It is not too far north of here. That path should allow you to find her without fighting through the quilboar.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 943;
