UPDATE `npc_text` SET `text0_0` = 'Zando''zan of the Shattered Hand. How can Zando''zan help you? He can''t! He won''t!$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1039;
UPDATE `npc_text` SET `text0_0` = 'Krumn is the bull you are looking for. He can be found on the lower rise at Thunder Bluff Civic Information.',`text0_1` = 'Krumn is the bull you are looking for. He can be found on the lower rise at Thunder Bluff Civic Information.',`text1_0` = 'A fellowship of kindred spirits can be a powerful force.  Krumn will help you to achieve this.  You will find him at the Thunder Bluff Civic Information center on the lower rise next to the lifts.',`text1_1` = 'A fellowship of kindred spirits can be a powerful force.  Krumn will help you to achieve this.  You will find him at the Thunder Bluff Civic Information center on the lower rise next to the lifts.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1291;
UPDATE `npc_text` SET `text0_0` = 'Don''t blame you for taking up fishing.  Mulgore has some the best fishing spots in Southern Kalimdor and Mountaintop Bait & Tackle on the high rise has all of the gear you''ll need to take advantage of it.$B$BTell Kah Mistrunner that I sent ya!',`text0_1` = 'Don''t blame you for taking up fishing.  Mulgore has some the best fishing spots in Southern Kalimdor and Mountaintop Bait & Tackle on the high rise has all of the gear you''ll need to take advantage of it.$B$BTell Kah Mistrunner that I sent ya!',`text1_0` = 'Kah Mistrunner at Mountaintop Bait & Tackle on the high rise will show you the way to find inner peace and serenity while fishing for your next meal.',`text1_1` = 'Kah Mistrunner at Mountaintop Bait & Tackle on the high rise will show you the way to find inner peace and serenity while fishing for your next meal.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1337;
UPDATE `npc_text` SET `text0_0` = 'The beasts of these blasted lands exhibit preternatural attributes, heretofore unseen in nature.$B$BWe have theorized that the energy which was released upon the opening of the Dark Portal, infused into their physical being and forced the creatures to evolve into their current forms.$B$BFearsome beasts they are, no doubt, but we also believe that they could prove to be quite useful in our studies.$B$BPerhaps you would be interested in assisting us in the study of these beasts, $N?$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1351;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'While my brother, Drazial, focuses his analysis on the more physical nature of the beasts of the blasted lands, I tend to focus on the more cerebral and spiritual aspects of the wildlife.$B$BIt is true that the beasts exhibit extremely unusual strength, agility, and stamina, but some of them also possess great intelligence and regenerative abilities, untied to their physical being.$B$BPerhaps you would be interested in helping advance my research, $r?$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1371;
UPDATE `npc_text` SET `text0_0` = 'Brzzzzt!$B$BWelcome to Matrix Punchograph 3005 stroke B, a security level beta terminal.$B$BYou must posses a yellow punch card to access terminal functions.$B$B01000111 01101110 01101111 01101101 01100101 01110010 01100011 01111001 00100001',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1647;
UPDATE `npc_text` SET `text0_0` = 'Brzzzzt!$B$BWelcome to Matrix Punchograph 3005 stroke C, a security level chi terminal.$B$BYou must posses a blue punch card to access terminal functions.$B$B01010010 01100101 01100011 01101001 01110000 01100101 00111010 00100000 01001101 01100101 01100011 01101000 01100001 01101110 01101001 01100011 01100001 01101100 00100000 01000011 01101000 01101001 01100011 01101011 01100101 01101110 00100000 01010011 01101111 01110101 01110000',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1649;
UPDATE `npc_text` SET `text0_0` = 'Brzzzzt!$B$BWelcome to Matrix Punchograph 3005 stroke D, a security level delta terminal.$B$BYou must posses a red punch card to access terminal functions.$B$B01010011 01101000 01101111 01110010 01110100 00100000 01100001 01101110 01100100 00100000 01110011 01110111 01100101 01100101 01110100',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1651;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Thank the light you are here! I''d accept help from a two-headed ogre at this point.$B$BThe city has been overrun by troggs! The attempts to wipe them out resulted in mass contamination. But there is still hope.$B$BOur scientists who evacuated to Ironforge are working on a cure for the fallout sickness. Meanwhile, if you can help me stop the trogg invasion, perhaps the city can be retaken. ',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1693;
UPDATE `npc_text` SET `text0_0` = 'The fact that you are here is a first step... a correct choice if you will, in aiding Ysera''s Dragonflight.$B$BYou may be here for purely the lure of personal gain, or you may be here because you are morally compelled.  Neither reason is important on its own, but both are in fact critical to this end: The agony that Eranikus endures is what rousted me from my Dream, and it is now my charge to see his torment ended.  I now ask you to aid me in this quest.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 1999;
UPDATE `npc_text` SET `text0_0` = 'My great hammer, Ironfel, was handed down to the new chief architect, Fineous Darkvire: A man of despicable motive and little talent.$B$BThis is where you come in, $N. I want him stopped. He is too inept to harness the true power of Ironfel, but should one come after him with the aptitude to use Ironfel to its full potential, the destruction they could cause with their creations would be disastrous to this world.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2318;
UPDATE `npc_text` SET `text0_0` = 'Do I look stupid to you, $r? I may as well sign her death warrant myself! Why should I trust you?$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2475;
UPDATE `npc_text` SET `text0_0` = 'We have our duties, $c.  Duties to the Horde.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2533;
UPDATE `npc_text` SET `text0_0` = 'Do ye have some new treasures that ye want to keep safe n'' sound?  Then ye''ll be wanting to store them at The Vault with the Stonemantles.  $B$BYe''ll find The Vault just a hammer''s throw northeast from the entrance to Ironforge.',`text0_1` = 'Do ye have some new treasures that ye want to keep safe n'' sound?  Ye''ll be wanting to store them at The Vault with the Stonemantles.  Ye''ll find The Vault just a hammer''s throw northeast from the entrance to Ironforge.',`text1_0` = 'The bank?  Oh, ye mean The Vault!  No safer place to store yer valuables than The Vault. Ye''ll find it just northeast of the entrance to Ironforge. ',`text1_1` = 'The bank?  Oh, ye mean The Vault!  No safer place to store yer valuables than The Vault. Ye''ll find it just northeast of the entrance to Ironforge. ',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2761;
UPDATE `npc_text` SET `text0_0` = 'Looking to take a ride on a gryphon, now are ye?  Gryth Thurden is the one ye''ll want to be seeing about that.  $B$BYe can find him on the eastern side of The Great Forge in the middle of Ironforge.',`text0_1` = 'Looking to take a ride on a gryphon, now are ye?  Gryth Thurden is the one ye''ll want to be seeing about that.  $B$BYe can find him on the eastern side of The Great Forge in the middle of Ironforge.',`text1_0` = 'Ah, nothing quite like a ride on a gryphon, is there?  The night elves can keep those hippo''s of theirs, just give me a gryphon and the wind in me hair!  $B$BWell now, I won''t keep ye any longer, just head over to Gryth Thurden on the east side of The Great Forge and he''ll get ye on yer way.',`text1_1` = 'Ah, nothing quite like a ride on a gryphon, is there?  The night elves can keep those hippo''s of theirs, just give me a gryphon and the wind in me hair!  $B$BWell now, I won''t keep ye any longer, just head over to Gryth Thurden on the east side of The Great Forge and he''ll get ye on yer way.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2762;
UPDATE `npc_text` SET `text0_0` = 'You can find a mailbox right o''er by The Stonefire Tavern.  It''s just north of the gates of Ironforge.',`text0_1` = 'You can find a mailbox right o''er by The Stonefire Tavern.  It''s just north of the gates of Ironforge.',`text1_0` = 'Bah!  Mailboxes...  all I get is junk mail lately!  $B$BIncrease the size of this... decrease the size of that... act now for your free Sword of Dragonslaying.  I have to change my mailbox number every other month!  $B$BWell, ye can''t say I didn''t warn ye.  If you''re looking for the mailbox it''s just outside the Stonefire Tavern.',`text1_1` = 'Bah!  Mailboxes...  all I get is junk mail lately!  $B$BIncrease the size of this... decrease the size of that... act now for your free Sword of Dragonslaying.  I have to change my mailbox number every other month!  $B$BWell, ye can''t say I didn''t warn ye.  If you''re looking for the mailbox it''s just outside the Stonefire Tavern.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2769;
UPDATE `npc_text` SET `text0_0` = 'That wee wizardly lass, Bink, over in the Hall of Mysteries would probably be able to help ye out with any magical needs you have.  $B$BThe Hall of Mysteries is just north of the gates of Ironforge.',`text0_1` = 'That wee wizardly lass, Bink, over in the Hall of Mysteries would probably be able to help ye out with any magical needs you have.$B$BThe Hall of Mysteries is just north of the gates of Ironforge.',`text1_0` = 'Well ye''d be sure to find some training in the magical arts over in the Hall of Mysteries, north of the gates of Ironforge.  Juli Stormkettle can always be found there with her nose in a book.',`text1_1` = 'Well ye''d be sure to find some training in the magical arts over in the Hall of Mysteries, north of the gates of Ironforge.  Juli Stormkettle can always be found there with her nose in a book.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2771;
UPDATE `npc_text` SET `text0_0` = 'Ah, Braenna Flintcrag.  She has magic hands, that one.  Braenna is the one to see about Priestly matters.  $B$BYe''ll want to travel north from the gates of Ironforge to the Hall of Mysteries.  That''s where ye''ll find her.',`text0_1` = 'Ah, Braenna Flintcrag.  She has magic hands, that one.  Braenna is the one to see about Priestly matters.  $B$BYe''ll want to travel north from the gates of Ironforge to the Hall of Mysteries.  That''s where ye''ll find her.',`text1_0` = 'Ah, nothing better than a priest to cure what ails ye.  Of course a nice tall pint cures a lot of what ails ye too, but I don''t think Braenna Flintcrag teaches brewing.  I guess ye''ll have to settle for some priest training over in the Hall of Mysteries instead.',`text1_1` = 'Ah, nothing better than a priest to cure what ails ye.  Of course a nice tall pint cures a lot of what ails ye too, but I don''t think Braenna Flintcrag teaches brewing.  I guess ye''ll have to settle for some priest training over in the Hall of Mysteries instead.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2772;
UPDATE `npc_text` SET `text0_0` = 'Now why would ye be needing the services of one of those types?  We get enough trouble out of that rogue, Hulfdan Blackbeard, over in The Forlorn Cavern, do I need to be turning my eye to you as well?',`text0_1` = 'Now why would ye be needing the services of one of those types?  We get enough trouble out of that rogue, Hulfdan Blackbeard, over in The Forlorn Cavern, do I need to be turning my eye to you as well?',`text1_0` = 'All the roguish types hang out in The Forlorn Cavern, north of the gates of Ironforge.  I''d wager ye''ll find Fenthwick there, no doubt counting the coin of another cut purse.  I''ll catch him one of these days!  $B$BIn the meantime I''ll have my eye on you as well, $glad : lass;.',`text1_1` = 'All the roguish types hang out in The Forlorn Cavern, north of the gates of Ironforge.  I''d wager ye''ll find Fenthwick there, no doubt counting the coin of another cut purse.  I''ll catch him one of these days!  $B$BIn the meantime I''ll have my eye on you as well, $glad : lass;.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2774;
UPDATE `npc_text` SET `text0_0` = 'Where better to look for a dark and brooding lot, than the dark section of Ironforge, aptly named The Forlorn Cavern.  Thistleheart is sure to be found there, likely summoning some manner of vile creature to do his bidding.',`text0_1` = 'Where better to look for a dark and brooding lot, than the dark section of Ironforge, aptly named The Forlorn Cavern.  Thistleheart is sure to be found there, likely summoning some manner of vile creature to do his bidding.',`text1_0` = 'A warlock, eh...  Well, if you''ve got a mind to be doing that sort of thing around here then ye best keep yer demons on a leash $gboyo : girlie;.  I don''t like demons, but I love putting mah axe to them.  Ye get me?  $B$BNow you just leave me be and go get lost in The Forlorn Cavern.  That''s where you''ll find that warlock, Thistleheart.',`text1_1` = 'A warlock, eh...  Well, if you''ve got a mind to be doing that sort of thing around here then ye best keep yer demons on a leash $gboyo : girlie;.  I don''t like demons, but I love putting mah axe to them.  Ye get me?  $B$BNow you just leave me be and go get lost in The Forlorn Cavern.  That''s where you''ll find that warlock, Thistleheart.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2775;
UPDATE `npc_text` SET `text0_0` = 'Och! Ye seek training in the way of the warrior, do ye?  Kelstrum Stonebreaker will put ye through yer paces!  Just march yerself over to the Hall of Arms east of the gates of Ironforge. ',`text0_1` = 'Och! Ye seek training in the way of the warrior, do ye?  Kelstrum Stonebreaker will put ye through yer paces!  Just march yerself over to the Hall of Arms east of the gates of Ironforge. ',`text1_0` = 'Kelstrum is a loudmouth and a braggart... and if that weren''t enough he''s also one of the most skilled warriors ye''ll ever meet!  $B$BI tell ye, if ye''re looking to be trained in the ways of a warrior, that''s who ye should be talking to.  I''m sure he can be found over in the Hall of Arms east of the Gates of Ironforge.',`text1_1` = 'Kelstrum is a loudmouth and a braggart... and if that weren''t enough he''s also one of the most skilled warriors ye''ll ever meet!  $B$BI tell ye, if ye''re looking to be trained in the ways of a warrior, that''s who ye should be talking to.  I''m sure he can be found over in the Hall of Arms east of the Gates of Ironforge.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2776;
UPDATE `npc_text` SET `text0_0` = 'An Alchemy trainer is what you need?  Well, I just came from there, I did.  Ye''ll find Ms. Berryfizz over in Tinker Town where the gnomes gather.',`text0_1` = 'An Alchemy trainer is what you need?  Well, I just came from there, I did.  Ye''ll find Ms. Berryfizz over in Tinker Town where the gnomes gather.',`text1_0` = 'Yer looking for an Alchemy trainer are ye?  Just came from there, I did.  Ye''ll find Ms. Berryfizz over in Tinker Town where the gnomes gather.  $B$B::sigh:: ...why o'' why didn''t I take the blue potion.',`text1_1` = 'Yer looking for an Alchemy trainer are ye?  Just came from there, I did.  Ye''ll find Ms. Berryfizz over in Tinker Town where the gnomes gather.  $B$B::sigh:: ...why o'' why didn''t I take the blue potion.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2794;
UPDATE `npc_text` SET `text0_0` = 'Ye''ve come to the right place $glad : lass;!  People come here from all o''er the world to train to be a blacksmith.  Ye''ll find Bengus Deepforge hammering away at an anvil in the middle of our fine city by The Great Forge itself.',`text0_1` = 'Ye''ve come to the right place $glad : lass;!  People come here from all o''er the world to train to be a blacksmith.  Ye''ll find Bengus Deepforge hammering away at an anvil in the middle of our fine city by The Great Forge itself.',`text1_0` = 'Are ye really askin'' me where the Blacksmith is?  Have ye not heard of The Great Forge!?  All our best blacksmiths gather there to craft their weapons and armor!  $B$BIt''s dead smack in the middle of Ironforge, and that''s where you''ll find one of our most brilliant blacksmiths, Bengus Deepforge.  ',`text1_1` = 'Are ye really askin'' me where the Blacksmith is?  Have ye not heard of The Great Forge!?  All our best blacksmiths gather there to craft their weapons and armor!  $B$BIt''s dead smack in the middle of Ironforge, and that''s where you''ll find one of our most brilliant blacksmiths, Bengus Deepforge.  ',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2795;
UPDATE `npc_text` SET `text0_0` = 'Ah, I believe Gimble Thistlefuzz is who ye''ll be needing if yer looking to learn the Enchanter''s profession.  Ye''ll find Gimble in his shop, Thistlefuzz Arcanery, right by the Gryphon Master at The Great Forge.',`text0_1` = 'Ah, I believe Gimble Thistlefuzz is who ye''ll be needing if yer looking to learn the Enchanter''s profession.  Ye''ll find Gimble in his shop, Thistlefuzz Arcanery, right by the Gryphon Master at The Great Forge.',`text1_0` = 'Och!  Ye should be careful what ye get enchanted $glad : lass;.  I had me mug enchanted so it wouldn''t spill a drop, but now I can''t drink from it!  Such a tragedy.  $B$BYou be sure to heed me advice when ye see Gimble.  He''ll be in his shop right by the Gryphon Master at The Great Forge.',`text1_1` = 'Och!  Ye should be careful what ye get enchanted $glad : lass;.  I had me mug enchanted so it wouldn''t spill a drop, but now I can''t drink from it!  Such a tragedy.  $B$BYou be sure to heed me advice when ye see Gimble.  He''ll be in his shop right by the Gryphon Master at The Great Forge.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2797;
UPDATE `npc_text` SET `text0_0` = 'The tinkerer''s craft for you is it?  No doubt ye''ll want to go see Springspindle Fizzlegear in Tinker Town.  $B$BJust head east from the gates of Ironforge, or follow the sound of the explosions.',`text0_1` = 'The tinkerer''s craft for you is it?  No doubt ye''ll want to go see Springspindle Fizzlegear in Tinker Town.  $B$BJust head east from the gates of Ironforge, or follow the sound of the explosions.',`text1_0` = 'Oh, you''re looking for Springspindle Fizzlegear then.  Why that little gnome and his gadgets...  Let me tell you, if you''re going to his shop in Tinker Town, keep your hands to yourself and don''t pet any of his mechanical sheep!  $B$BExploding sheep... now why would you even make such a thing!?',`text1_1` = 'Oh, you''re looking for Springspindle Fizzlegear then.  Why that little gnome and his gadgets...  Let me tell you, if you''re going to his shop in Tinker Town, keep your hands to yourself and don''t pet any of his mechanical sheep!  $B$BExploding sheep... now why would you even make such a thing!?',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2798;
UPDATE `npc_text` SET `text0_0` = 'Flowers and seeds and such?  That would be Reyna Stonebranch''s area of expertise.  Ye can find her tending to her plants over at the Ironforge Physician on the southern side of The Great Forge.',`text0_1` = 'Flowers and seeds and such?  That would be Reyna Stonebranch''s area of expertise.  Ye can find her tending to her plants over at the Ironforge Physician on the southern side of The Great Forge.',`text1_0` = 'Oh, ye want to learn to pick some daisies do ye?  Ha!  I''m just teasing ye $gladdie : lass;.  $B$BA fine profession it is, and Reyna Stonebranch can show ye how it''s done.  She works at the Ironforge Physician on the southern side of The Great Forge.',`text1_1` = 'Oh, ye want to learn to pick some daisies do ye?  Ha!  I''m just teasing ye $gladdie : lass;.  $B$BA fine profession it is, and Reyna Stonebranch can show ye how it''s done.  She works at the Ironforge Physician on the southern side of The Great Forge.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2801;
UPDATE `npc_text` SET `text0_0` = 'Do we have Mining trainers here?  Where do ye think ye are!?  $B$BWhy you''ll find one o'' the best miners in all Dun Morogh at the Deepmountain Mining Guild on the northern side of The Great Forge.  There, Geofram Bouldertoe will show ye the true art of mining.',`text0_1` = 'Do we have Mining trainers here?  Where do ye think ye are!?  $B$BWhy you''ll find one o'' the best miners in all Dun Morogh at the Deepmountain Mining Guild on the northern side of The Great Forge.  There, Geofram Bouldertoe will show ye the true art of mining.',`text1_0` = 'Well well!  You''ve come to the right place to learn Mining, $gboyo : girlie;!  Geofram Bouldertoe himself resides at the Deepmountain Mining Guild.  Ye couldn''t ask for a better instructor than him.',`text1_1` = 'Well well!  You''ve come to the right place to learn Mining, $gboyo : girlie;!  Geofram Bouldertoe himself resides at the Deepmountain Mining Guild.  Ye couldn''t ask for a better instructor than him.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2804;
UPDATE `npc_text` SET `text0_0` = 'That Jormund Stonebrow has a knack for the needle, he does.  Should you be needing some training, then you''ll find him at Stonebrow''s Clothier on the northern side of The Great Forge.',`text0_1` = 'That Jormund Stonebrow has a knack for the needle, he does.  Should you be needing some training, then you''ll find him at Stonebrow''s Clothier on the northern side of The Great Forge.',`text1_0` = 'Ye might not know it, but in addition to being a skilled tailor, Jormund is also a slayer of giants!  Why he must have overheard a few of us sharing stories when he shouted that he''d killed seven with one blow!  $B$BYe should pay him a visit at his store on the north side of The Great Forge an'' see if he''ll tell ye the tale!',`text1_1` = 'Ye might not know it, but in addition to being a skilled tailor, Jormund is also a slayer of giants!  Why he must have overheard a few of us sharing stories when he shouted that he''d killed seven with one blow!  $B$BYe should pay him a visit at his store on the north side of The Great Forge an'' see if he''ll tell ye the tale!',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2807;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c. For some, the hunter is a way of life, a chosen profession. For others, it is something of a pastime, a badge of courage, or a rite of passage depending on your tribe.$B$BFor me, race and profession mean nothing--it is the testing of your spirit and mind that I respect. For one to stand against the forces of nature and test all of their skills is the true mark of honor.$B$BIf you wish to test yourself and earn my respect, then speak to me more.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2816;
UPDATE `npc_text` SET `text0_0` = 'The ravasaur here in Un''Goro seem to be related to the raptors of the barrens--highly intelligent, volatile, and with a sense or code of conduct. The greatest of these that I have encountered is  Lar''korwi. He is one of the most dangerous beasts I''ve ever seen. In taurahe, Lar''korwi means "sharp claw," but that does not do him justice.$B$BDo not underestimate Lar''korwi if you ever plan on hunting him, but I will help you in any way I can if you do.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 2835;
UPDATE `npc_text` SET `text0_0` = 'The Temple of the Moon is home to the priests of Elune.  There you will find Jandria and Lariia, who will provide you with further guidance in the path of priesthood.',`text0_1` = 'The Temple of the Moon is home to the priests of Elune.  There you will find Jandria and Lariia, who will provide you with further guidance in the path of priesthood.',`text1_0` = 'The power of Elune compels you!  The power of Elune compels you!  $B$BGo now!  Seek out Jandria in the central hall of the Temple of the Moon in the southern section of Darnassus!',`text1_1` = 'The power of Elune compels you!  The power of Elune compels you!  $B$BGo now!  Seek out Jandria in the central hall of the Temple of the Moon in the southern section of Darnassus!',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3025;
UPDATE `npc_text` SET `text0_0` = 'Alegorn is a masterful chef who has had centuries with which to perfect his cooking.  You should consider yourself blessed should he decide to teach you.  If you believe you are worthy, you can find him in the Craftsmen''s Terrace.',`text0_1` = 'Alegorn is a masterful chef who has had centuries with which to perfect his cooking.  You should consider yourself blessed should he decide to teach you.  If you believe you are worthy, you can find him in the Craftsmen''s Terrace.',`text1_0` = 'The dishes that Alegorn whips up are to die for.  He''s always busy preparing new delicacies over in the Craftsman''s Terrace.  Be sure to try his Cenarion Green recipe if he has any left.  $B$BNow, if you don''t mind, I must investigate this rash of missing deer. ',`text1_1` = 'The dishes that Alegorn whips up are to die for.  He''s always busy preparing new delicacies over in the Craftsman''s Terrace.  Be sure to try his Cenarion Green recipe if he has any left.  $B$BNow, if you don''t mind, I must investigate this rash of missing deer. ',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3036;
UPDATE `npc_text` SET `text0_0` = 'The skill with which Telonis crafts armor is beyond compare.  You should be grateful that he does not charge more for the knowledge he passes to others.  Go now and seek him out in the Craftsmen''s Terrace in the northeast section of Darnassus.',`text0_1` = 'The skill with which Telonis crafts armor is beyond compare.  You should be grateful that he does not charge more for the knowledge he passes to others.  Go now and seek him out in the Craftsmen''s Terrace in the northeast section of Darnassus.',`text1_0` = 'We plant the vegetables.  Our vegetables are eaten by the rabbit.  The rabbit is devoured by the wolf.  The wolf is slain by us.  We take the meat and hide from the wolf''s corpse.  It''s that Magic Circle of life, or whatever you call it.  $B$BNow go see Telonis in the Cenarion Enclave to get started and let me return to my duties.',`text1_1` = 'We plant the vegetables.  Our vegetables are eaten by the rabbit.  The rabbit is devoured by the wolf.  The wolf is slain by us.  We take the meat and hide from the wolf''s corpse.  It''s that Magic Circle of life, or whatever you call it.  $B$BNow go see Telonis in the Cenarion Enclave to get started and let me return to my duties.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3040;
UPDATE `npc_text` SET `text0_0` = 'In death, the animals of the world bestow both life and protection unto us.  If you feel that you can offer the appropriate respect for their sacrifice, then the skinner''s profession may suit you.  Speak with Eladriel in the Craftsmen''s Terrace in northern Darnassus to learn more.',`text0_1` = 'In death, the animals of the world bestow both life and protection unto us.  If you feel that you can offer the appropriate respect for their sacrifice, then the skinner''s profession may suit you.  Speak with Eladriel in the Craftsman''s Terrace in northern Darnassus to learn more.',`text1_0` = 'As a culture we believe in letting nothing go to waste.  When we are forced to slay a creature we take what we can to make sure its sacrifice was not in vain.  $B$BIf you wish to learn the proper way to take the skin of a slain beast, then seek out Eladriel in the Craftsmen''s Terrace.',`text1_1` = 'As a culture we believe in letting nothing go to waste.  When we are forced to slay a creature we take what we can to make sure its sacrifice was not in vain.  $B$BIf you wish to learn the proper way to take the skin of a slain beast, then seek out Eladriel in the Craftsmen''s Terrace.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3042;
UPDATE `npc_text` SET `text0_0` = 'Deathwing, or Neltharion as he was once known, was the Aspect that embodied the strength of the world - granted almost limitless power over this mortal realm by the Titan shaper known as Khaz''goroth: Forger of the world.$B$BThrough treachery and deceit, the foul one convinced the four other Aspects to imbue an item, known as the Demon Soul, with their powers - greatly weakening them, forcing a division among the once great Aspects. $b',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3304;
UPDATE `npc_text` SET `text0_0` = 'It is possible for one, not of dragon kind, to obtain the Adorned Seal of Ascension and pass through the protected barrier. While possession of such an item would surely destroy me, perhaps you could utilize it and lower the barrier.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3308;
UPDATE `npc_text` SET `text0_0` = 'I hope to one day forge weapons and armor from the bones of my enemies.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3421;
UPDATE `npc_text` SET `text0_0` = 'I thank you, $N. Your dedication to my plea gives rest to my lost wife''s spirit, and for that I could never repay you enough.$B$BI cannot say that my hatred will ever cease for the quilboar, but it is satiated for now.$B$BNow I must begin to rebuild my life.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3554;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'The body is that of a female orc warrior.$B$BIt is clear that she died in battle, probably against the quilboar in the area.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3557;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'You turn the body over and see the marks from blades and spells upon the deceased orc--her armor all but destroyed, her hair matted to her face.$B$BBased on Mankrik''s description of her, there is no doubt in your mind that this was his wife.$B$BHe will be upset by the news, but you are sure he should know the truth.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3558;
UPDATE `npc_text` SET `text0_0` = '<Goretooth spits.>$B$BI am a warrior of the Horde, $N. It fills me with rage to know that our enemies sit in a fortress, less than a day''s ride from Kargath, plotting against us.$B$BHow I long to break free from the bonds of duty and destroy them all in the name of the Warchief.$B$BAlas, we all have roles we must fulfill.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3560;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Hello there, $N.  I am known as Chronormu, but you may call me Chromie.  I am comfortable with such familiarity.$B$BNow - how did I know your name, you ask?  I am one of the bronze dragonflight, forever attuned to the ebb and flow of time.  You could say that we have met before.  To that end, we shall also meet again.$B$BI hope that my choice of visual demeanor does not disturb you; while I might be charged to be a sentry of sorrowful places, I choose not to drown in the sorrow of the locale.$B$B$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3584;
UPDATE `npc_text` SET `text0_0` = 'A diary with yellowing pages lies open to the last entry:$B$B"I don''t know what''s going to happen now that Harold''s turned.  It took everything out of me to drag him into the only place I could find that''d lock him up tight and hold him.  I hid the key on me, and I pray it works...$B$BI hope I can get out of here, but I need money to do that.  Our stuff''s all in the cabinet I think... and now that I think about it, doesn''t Harold keep the key on him?$B$BI''ll rest on it, I''m dead tired now."',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3694;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'I welcome you, $N. And the Emerald Circle welcomes you.$B$BHopefully together we can help rejuventate and protect this once-mighty forest. Many forces seek to destroy it from without... and within.$B$BDo not be persuaded by the power here--it will only corrupt you, like it has this entire land.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3807;
UPDATE `npc_text` SET `text0_0` = 'Aye, everyone wants to ride the tram, it''s a real hoot and a half.  Well, if ye want to find the tram, it''s located over in Tinker Town just east of the gates of Ironforge.',`text0_1` = 'Aye, everyone wants to ride the tram, it''s a real hoot and a half.  Well, if ye want to find the tram, it''s located over in Tinker Town just east of the gates of Ironforge.',`text1_0` = 'Oh, the tram, the tram...  everyone wants to ride the tram.  What happened to the good ol'' days of flying on the back of a gryphon, gripping the saddle for dear life as you flew up high in the sky above?  $B$BBah!  You go take the tram then... it''s over in Tinker Town with the rest of the gnomish contraptions.',`text1_1` = 'Oh, the tram, the tram...  everyone wants to ride the tram.  What happened to the good ol'' days of flying on the back of a gryphon, gripping the saddle for dear life as you flew up high in the sky above?  $B$BBah!  You go take the tram then... it''s over in Tinker Town with the rest of the gnomish contraptions.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3814;
UPDATE `npc_text` SET `text0_0` = 'It is located in the Trade District citizen.  It is nearly straight on from the entrance of Stormwind.',`text0_1` = 'It is located in the Trade District citizen.  It is nearly straight on from the entrance of Stormwind.',`text1_0` = 'Another entrepreneur, eh? Well, the Auction House can be found in the Trade District.  Not far from the bank.$B',`text1_1` = 'Another entrepreneur, eh? Well, the Auction House can be found in the Trade District.  Not far from the bank.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3834;
UPDATE `npc_text` SET `text0_0` = 'Hello, traveler. Not many find me out this way.$B$BMy name is Rivern, and I train the Winterspring Frostsabers to become mounts.$B$BThese cats are the most feral and difficult to subdue of all the sabers. Only the most trusted and exalted may attempt to ride one.$B$BI will not sell such a mount to just anyone; no, you must work for it and earn your acceptance not only with me, but with the sabers themselves.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3854;
UPDATE `npc_text` SET `text0_0` = 'The Scourge''s plague is almost to the turning point; a handful more cauldron subversions will push us over the top!  Be sure to do your part to help out!',`text0_1` = 'The Scourge''s plague is almost to the turning point; a handful more cauldron subversions will push us over the top!  Be sure to do your part to help out!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 3997;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Restraints? There are things in this world far more restraining than bars and shackles, young $g master:mistress;. The undead surrounded us, constantly tormenting us with horrifying acts of depravity.$B$BFinally, he came. He introduced himself as Doctor Theolen Krastinov. We came to know him as ''The Butcher.''',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4047;
UPDATE `npc_text` SET `text0_0` = 'That would be Shelene Rhobart.  Take the road southeast out of Brill then head east at the intersection.  She''s at a camp along the side of the road.',`text0_1` = 'That would be Shelene Rhobart.  Take the road southeast out of Brill then head east at the intersection.  She''s at a camp along the side of the road.',`text1_0` = 'Nothing quite like the feel of something dead rubbing up against you.  You can find Shelene Rhobart by heading southeast on the road out of town, and then going east at the intersection.  She''s at a small camp there not too far along the road.',`text1_1` = 'Nothing quite like the feel of something dead rubbing up against you.  You can find Shelene Rhobart by heading southeast on the road out of town, and then going east at the intersection.  She''s at a small camp there not too far along the road.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4090;
UPDATE `npc_text` SET `text0_0` = 'I usually leave that sort of thing to the gnomes.  If you want to take up the profession, I''m sure you could find some gnomes hanging out in Stormwind that would train you.',`text0_1` = 'I usually leave that sort of thing to the gnomes.  If you want to take up the profession, I''m sure you could find some gnomes hanging out in Stormwind that would train you.',`text1_0` = 'There is bound to be a gnome in Stormwind that can teach you the profession.  I''m sure one of the Stormwind Guards could point you in the right direction.',`text1_1` = 'There is bound to be a gnome in Stormwind that can teach you the profession.  I''m sure one of the Stormwind Guards could point you in the right direction.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4278;
UPDATE `npc_text` SET `text0_0` = 'I had a bad encounter with some of the Defias around here recently, but Michelle Belle fixed me up pretty well.  Check with her in the Lion''s Pride Inn and see if she''ll teach you.',`text0_1` = 'I had a bad encounter with some of the Defias around here recently, but Michelle Belle fixed me up pretty well.  Check with her in the Lion''s Pride Inn and see if she''ll teach you.',`text1_0` = 'Michelle Belle''s bedside manner is remarkable!  While she might not be able to teach you that, she surely could teach you some proper First Aid.  She currently resides in the Lion''s Pride Inn.',`text1_1` = 'Michelle Belle''s bedside manner is remarkable!  While she might not be able to teach you that, she surely could teach you some proper First Aid.  She currently resides in the Lion''s Pride Inn.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4279;
UPDATE `npc_text` SET `text0_0` = 'Lee Brown spends the whole day fishing up by Crystal Lake.  He''s probably got some stories to tell and some tips he could teach you.',`text0_1` = 'Lee Brown spends the whole day fishing up by Crystal Lake.  He''s probably got some stories to tell and some tips he could teach you.',`text1_0` = 'Lee''s caught some pretty odd things up at Crystal Lake.  He told me a story about this weird mask he fished up some months ago.  If you ask me, I think he just had one too many at the Lion''s Pride that night.',`text1_1` = 'Lee''s caught some pretty odd things up at Crystal Lake.  He told me a story about this weird mask he fished up some months ago.  If you ask me, I think he just had one too many at the Lion''s Pride that night.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4280;
UPDATE `npc_text` SET `text0_0` = 'Ms. Pomeroy gathers herbs for an Alchemist who lives up in the hills between Northshire and Stormwind.  Check for her at his cottage and see if she''ll show you the profession.',`text0_1` = 'Ms. Pomeroy gathers herbs for an Alchemist who lives up in the hills between Northshire and Stormwind.  Check for her at his cottage and see if she''ll show you the profession.',`text1_0` = 'There''s an herbalist that lives in the hills east of Stormwind with our alchemist. Quite the handy pairing don''t you think?',`text1_1` = 'There''s an herbalist that lives in the hills east of Stormwind with our alchemist. Quite the handy pairing don''t you think?',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4281;
UPDATE `npc_text` SET `text0_0` = 'Over by Crystal Lake there lives a lady named Adele Fielder.  She makes patches for the local guards with the extra leather she gets from the local skinner, Helene.  She would probably be the one to see if you''re interested in learning the profession.',`text0_1` = 'Over by Crystal Lake there lives a lady named Adele Fielder.  She makes patches for the local guards with the extra leather she gets from the local skinner, Helene.  She would probably be the one to see if you''re interested in learning the profession.',`text1_0` = 'Adele Fielder has made a name for herself as a leatherworker around Elwynn.  You can find her working out of her home up by Crystal Lake.',`text1_1` = 'Adele Fielder has made a name for herself as a leatherworker around Elwynn.  You can find her working out of her home up by Crystal Lake.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4282;
UPDATE `npc_text` SET `text0_0` = 'There''s a mage at the Thunderbrew Distillery who might be able to teach you some new spells.  I believe his name is Magis Sparkmantle.',`text0_1` = 'There''s a mage at the Thunderbrew Distillery who might be able to teach you some new spells.  I believe his name is Magis Sparkmantle.',`text1_0` = 'Ye sure ye don''t want to learn to be a warrior?  Well, it''s yer hide on the battlefield.  If ye really want to learn to waggle yer finger, ye best talk to Magis Sparkmantle in the Thunderbrew Distillery.',`text1_1` = 'Ye sure ye don''t want to learn to be a warrior?  Well, it''s yer hide on the battlefield.  If ye really want to learn to waggle yer finger, ye best talk to Magis Sparkmantle in the Thunderbrew Distillery.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4294;
UPDATE `npc_text` SET `text0_0` = 'Och... a paladin?  Well $glad : lass;, ye''re in luck!  Azar Stronghammer is back from training and is currently staying at the Thunderbrew Distillery in Kharanos.',`text0_1` = 'Och... a paladin?  Well $glad : lass;, ye''re in luck!  Azar Stronghammer is back from training and is currently staying at the Thunderbrew Distillery in Kharanos.',`text1_0` = 'Ye need some training?  Well, Azar Stronghammer is always up for showing the younger paladins a thing or two.  Why don''t ye go see him in the Thunderbrew Distillery.',`text1_1` = 'Ye need some training?  Well, Azar Stronghammer is always up for showing the younger paladins a thing or two.  Why don''t ye go see him in the Thunderbrew Distillery.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4295;
UPDATE `npc_text` SET `text0_0` = 'Oh, a priest is it?  Well good ol'' Maxan is sure to be found having a drink in the Thunderbrew Distillery if ye need a bit of training.',`text0_1` = 'Oh, a priest is it?  Well good ol'' Maxan is sure to be found having a drink in the Thunderbrew Distillery if ye need a bit of training.',`text1_0` = 'Ye''ll surely find Maxan Anvol tossin'' back a few in the Thunderbrew Distillery.  Why don''t ye go have yerself a pint and see if he''ll teach ye something new.',`text1_1` = 'Ye''ll surely find Maxan Anvol tossin'' back a few in the Thunderbrew Distillery.  Why don''t ye go have yerself a pint and see if he''ll teach ye something new.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4296;
UPDATE `npc_text` SET `text0_0` = 'Ye should check over at Steelgrill''s Depot for Bronk.  When he''s not tinkering with some odd device, he''s usually chatting up the pilots about their steam tanks.',`text0_1` = 'Ye should check over at Steelgrill''s Depot for Bronk.  When he''s not tinkering with some odd device, he''s usually chatting up the pilots about their steam tanks.',`text1_0` = 'With all the screws that Bronk has been tightening, I think he''s let a few of his own go if ye get me.  All the same he''s still got a good head for engineering the darndest devices.  Ye should go pay him a visit over at Steelgrill''s Depot.',`text1_1` = 'With all the screws that Bronk has been tightening, I think he''s let a few of his own go if ye get me.  All the same he''s still got a good head for engineering the darndest devices.  Ye should go pay him a visit over at Steelgrill''s Depot.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4305;
UPDATE `npc_text` SET `text0_0` = 'Not much fishing to be had around here, but what little there is to be had is Paxton''s ye can be sure.  Ye can find him fishing out on Iceflow Lake.',`text0_1` = 'Not much fishing to be had around here, but what little there is to be had is Paxton''s ye can be sure.  Ye can find him fishing out on Iceflow Lake.',`text1_0` = 'Only a few spots to get any fishing done around here.  Paxton knows them all and probably a few he won''t tell ya about.  Why don''t ye go over to Iceflow Lake and see what he will tell ya.',`text1_1` = 'Only a few spots to get any fishing done around here.  Paxton knows them all and probably a few he won''t tell ya about.  Why don''t ye go over to Iceflow Lake and see what he will tell ya.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4307;
UPDATE `npc_text` SET `text0_0` = 'Ah, Stonebrow doesn''t leave Ironforge much these days so if ye''re looking to learn the tailor''s profession ye''ll have to go to see him up in Ironforge.',`text0_1` = 'Ah, Stonebrow doesn''t leave Ironforge much these days so if ye''re looking to learn the tailor''s profession ye''ll have to go to see him up in Ironforge.',`text1_0` = 'Well, ye won''t have much luck with finding a tailor out here.  Ironforge is home to a quite a few talented tailors though.  Why don''t ye go ask a guard there.',`text1_1` = 'Well, ye won''t have much luck with finding a tailor out here.  Ironforge is home to a quite a few talented tailors though.  Why don''t ye go ask a guard there.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4313;
UPDATE `npc_text` SET `text0_0` = 'While Cyndra is not bubbly like her potions, her kind manner is suitable for teaching her trade.  You can find her just east of the Inn in Dolanaar.',`text0_1` = 'While Cyndra is not bubbly like her potions, her kind manner is suitable for teaching her trade.  You can find her just east of the Inn in Dolanaar.',`text1_0` = 'Cyndra''s knowledge in alchemy is somewhat limited, but I''m sure it would be sufficient to get you started.  She practices her craft just east of the Inn in Dolanaar.',`text1_1` = 'Cyndra''s knowledge in alchemy is somewhat limited, but I''m sure it would be sufficient to get you started.  She practices her craft just east of the Inn in Dolanaar.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4329;
UPDATE `npc_text` SET `text0_0` = 'Zarrin seems to have a good knowledge of the cooking trade.  Why don''t you go see if he will show you some recipes?  He is usually cooking over by the Inn in Dolanaar.',`text0_1` = 'Zarrin seems to have a good knowledge of the cooking trade.  Why don''t you go see if he will show you some recipes?  He is usually cooking over by the Inn in Dolanaar.',`text1_0` = 'We could certainly use another cook around Dolanaar, not that Zarrin''s cooking is lacking mind you.  Why don''t you go see what he can teach you?',`text1_1` = 'We could certainly use another cook around Dolanaar, not that Zarrin''s cooking is lacking mind you.  Why don''t you go see what he can teach you?',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4330;
UPDATE `npc_text` SET `text0_0` = 'Alanna Raveneye attributes part of her talent in enchanting to her communion with the spirits at the Oracle Glade.  You should be able to find her there now.',`text0_1` = 'Alanna Raveneye attributes part of her talent in enchanting to her communion with the spirits at the Oracle Glade.  You should be able to find her there now.',`text1_0` = 'Alanna spends most of her day at the Oracle Glade where she practices her profession.  Should you wish to learn the Enchanter''s profession you will need to go there to find her.',`text1_1` = 'Alanna spends most of her day at the Oracle Glade where she practices her profession.  Should you wish to learn the Enchanter''s profession you will need to go there to find her.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4331;
UPDATE `npc_text` SET `text0_0` = 'Byancie has often lent her services to the sentinels who patrol the local wilds.  You should talk to her if you desire to learn First Aid.',`text0_1` = 'Byancie has often lent her services to the sentinels who patrol the local wilds.  You should talk to her if you desire to learn First Aid.',`text1_0` = 'Byancie''s skill in First Aid has proven useful on numerous occasions.  You can find her just north of the Inn in Dolanaar if you wish to learn from her.',`text1_1` = 'Byancie''s skill in First Aid has proven useful on numerous occasions.  You can find her just north of the Inn in Dolanaar if you wish to learn from her.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4332;
UPDATE `npc_text` SET `text0_0` = 'All the fisherman have moved to Darnassus with the recent attacks around Lake Al''Ameth.  You should try looking for someone to train you there.',`text0_1` = 'All the fisherman have moved to Darnassus with the recent attacks around Lake Al''Ameth.  You should try looking for someone to train you there.',`text1_0` = 'The Timberlings have made it too difficult for the fishermen to catch anything around Dolanaar.  You best look for someone to train you in Darnassus.',`text1_1` = 'The Timberlings have made it too difficult for the fishermen to catch anything around Dolanaar.  You best look for someone to train you in Darnassus.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4333;
UPDATE `npc_text` SET `text0_0` = 'I am certain there is a Tailor that could provide you training in Darnassus.  When you arrive, ask one of the Sentinels in Darnassus about seeing a Tailor.',`text0_1` = 'I am certain there is a Tailor that could provide you training in Darnassus.  When you arrive, ask one of the Sentinels in Darnassus about seeing a Tailor.',`text1_0` = 'Many of the supplies the tailors need come by way of Darnassus.  It is not surprising that they all moved there to work.  If you wish to be a tailor then you best head to Darnassus.',`text1_1` = 'Many of the supplies the tailors need come by way of Darnassus.  It is not surprising that they all moved there to work.  If you wish to be a tailor then you best head to Darnassus.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4337;
UPDATE `npc_text` SET `text0_0` = 'Long ago, before the last great war, my father ran the Northridge Lumber Mill. It was his life, and he was committed to it. Then the war came, and as much as it pained him, we had to flee to Stormwind.$B$BWe lost a number of friends and family in those days, and it pains me to know that the Scarlet Crusade has taken the mill for their own ends.$B$BThat''s why I''ve returned.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4357;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Do you require an illusion?$B$BShould your illusion falter in the midst of your quest, return to me and I shall reapply the guise.$B$BShould you fail in your endeavors, do not give up! Return to me. I shall assist you until you have completed your objectives.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4773;
UPDATE `npc_text` SET `text0_0` = 'Hey mon! You''ve ever been diving deep in the ocean? I''ll let you in on a little secret, eh. Deep in the ocean you can find bubbly fissures; they''ll allow you to breathe air while underwater.  Let''s keep this secret between you and me though, eh. I don''t need no competition for me shellfish traps elsewhere... if you get my drift!$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4891;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Would you like a flight to Rut''theran Village, courtesy of the Cenarion Circle?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4914;
UPDATE `npc_text` SET `text0_0` = 'I don''t train your kind, $c.  Find your own trainer before you anger me.',`text0_1` = 'I don''t train your kind, $c.  Find your own trainer before you anger me.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 4985;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Elune-adore, my $gbrother:sister;. You are welcome here.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 5025;
