UPDATE `npc_text` SET `text0_0` = 'Greetings, traveler! Care to delve into the mysteries of the arcane? Hm?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 5233;
UPDATE `npc_text` SET `text0_0` = 'Ah, gentle Seriadne.  All animals are safe while in her care.  You can find her just outside the Inn in Dolanaar.',`text0_1` = 'Ah, gentle Seriadne.  All animals are safe while in her care.  You can find her just outside the Inn in Dolanaar.',`text1_0` = 'You seek someone who cares for animals?  Then you should look for Seriadne outside the Inn in Dolanaar.  She is the one that you seek.',`text1_1` = 'You seek someone who cares for animals?  Then you should look for Seriadne outside the Inn in Dolanaar.  She is the one that you seek.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 5982;
UPDATE `npc_text` SET `text0_0` = '$N, you are ready for the ultimate task.  The fiery runes etched on the floor of the molten core are conduits to the realm of fire, and their presence is both an affront to us and a source of power for the Firelords.  They must be extinguished!$B$BTo extinguish a rune, take a vial of aqual quintessence.  Pour it on the rune and its flame will go out, rendering it useless and weakening our enemy!',`text0_1` = 'Hey there, friend. My name''s Remy. I''m from Redridge to the east, and came here looking for business, looking for business. You got any...got any??',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6158;
UPDATE `npc_text` SET `text0_0` = 'Here to learn how to wield a new weapon, or just to waste my time?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6233;
UPDATE `npc_text` SET `text0_0` = 'A wondrous Winter Veil to you... uh... little $G boy : girl;.  Good children get special, um, discounts at any local Smokywood Pastures vendor.  Yum.',`text0_1` = NULL,`text1_0` = 'I have a pretty good idea what ol'' Greatfather Winter''s gonna be doing when this shift is over.  I got a bottle of Winter Veil cheer right here in my bag, and I intend to get to the bottom of it.',`text1_1` = NULL,`text2_0` = 'No... you can''t sit on my lap.',`text2_1` = NULL,`text3_0` = 'Yeah, sure, go ahead and tell ol'' Greatfather Winter what you''d like for this Winter Veil.$B$BHo ho hurry up.' WHERE `ID` = 6250;
UPDATE `npc_text` SET `text0_0` = 'Heya mon.  You come right place learn how ta wield a new weapon.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6275;
UPDATE `npc_text` SET `text0_0` = 'Can I show you what I have for sale?$B$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6595;
UPDATE `npc_text` SET `text0_0` = 'Your skill exceeds mine, though  I''ve heard that Old Man Heming in Booty Bay has copies of "The Bass and You".  That is sure to help you increase your skill.',`text0_1` = 'Your skill exceeds mine, though  I''ve heard that Old Man Heming in Booty Bay has copies of "The Bass and You".  That is sure to help you increase your skill.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6794;
UPDATE `npc_text` SET `text0_0` = 'In the time before time, what the usurpers would later call the First Age of Creation, my master and his siblings ruled over this world. It was they, the Old Gods, who created all.$B$BAnd it was they who would ultimately be cast down by those that would call themselves Shapers.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6843;
UPDATE `npc_text` SET `text0_0` = 'Their manifest forms weak from eons of battle, imprisoned beneath the world - the world that they themselves created - the corruption of the Titan Shapers would permeate through the surface and befoul the Old Gods.$B$BIt was then and there that the brothers did turn. For five millennia a battle was fought at the core of this world.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6844;
UPDATE `npc_text` SET `text0_0` = 'It was during the Elemental Sundering that the Firelord, Ragnaros, would seek to consume my Lord, Thunderaan, Prince of Air.$B$B<Demitrian bows his head, his face contorted in rage.>$B$BSpeak his name and I shall decorate this ravaged camp with your entrails. Be silent and listen.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6867;
UPDATE `npc_text` SET `text0_0` = 'What little remained of Thunderaan''s essence was stored within a talisman of elemental binding. Ragnaros then shattered the talisman in two flawless pieces. The pieces assigned to his Lieutenants...$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 6870;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'There are costs with war, $c... ones often overlooked.  Those costs are the orphans - children who have lost their parents to the far-too-numerous conflicts that rage across Azeroth.  Those children who have no one else to turn to often come here to live until they are old enough to fend for themselves.$B$BOne week out of the year during the Spring, the Horde takes time to give something back to these innocents.  This time is called Children''s Week.$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7010;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'There are costs with war, $c... ones often overlooked.  Those costs are the orphans - children who have lost their parents to the far-too-numerous conflicts that rage across Azeroth.  Those children who have no one else to turn to often come here to live until they are old enough to fend for themselves.$B$BOne week out of the year during the Spring, the Alliance takes time to give something back to these innocents.  This time is called Children''s Week.$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7011;
UPDATE `npc_text` SET `text0_0` = 'Seek out Shandrina in Silverwind Refuge.  She can sell you the "Expert Cookbook".',`text0_1` = 'Seek out Shandrina in Silverwind Refuge.  She can sell you the "Expert Cookbook".',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7016;
UPDATE `npc_text` SET `text0_0` = 'Zul''jin shall return one day, $r. Mark my words. Until then, we all hold our positions and do what we can to keep the forest troll population intact.$B$BWith that said, as master huntsman of Revantusk Village, it is my responsibility to insure that the world around us is safe for habitation.$B$BThe beasts of this area must be kept in check.$B$BAre you looking for work?$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7242;
UPDATE `npc_text` SET `text0_0` = 'I have just completed a new dimensional imploder that will make me rich beyond my wildest goblin dreams!   All I need to do is get a skilled Goblin Engineer to build a dimensional ripper that connects to it and try it! $B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7249;
UPDATE `npc_text` SET `text0_0` = 'It''s not always about money, clem!  While we receive generous donations - some extremely substantial - our traveling troupe of performers is fueled creatively by a need to brighten this war-torn world.  Don''t worry about us, but instead let us worry about how to best entertain you.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7336;
UPDATE `npc_text` SET `text0_0` = 'It''s here!  The Darkmoon Faire is now open for business!  Be sure to see the most exciting show on all of Azeroth!',`text0_1` = NULL,`text1_0` = 'The Darkmoon Faire has come to town!  Be sure to experience the most thrilling show you''ll ever see!',`text1_1` = NULL,`text2_0` = 'The Darkmoon Faire will only be live for a short time before the curtains are drawn closed.  Be sure to visit it today!',`text2_1` = NULL,`text3_0` = 'Boys and girls - children of all ages - the Darkmoon Faire has arrived!  Huzzah!' WHERE `ID` = 7375;
UPDATE `npc_text` SET `text0_0` = 'The Paragons of Power are remnants from the ancient Gurubashi Empire.  We Zandalar seek them - not only are they of tremendous collectible value to us, but we believe that they also hold latent signatures of magic used by the old Empire.$B$BYou''ll more than likely discover three kinds of Paragons in Zul''Gurub: coins, bijous, and primal items.  Bring them to us in the quantities that we seek, and you''ll be rewarded with some of the finest items we Zandalar have ever crafted.$B',`text0_1` = 'The Paragons of Power are remnants from the ancient Gurubashi Empire.  We Zandalar seek them - not only are they of tremendous collectible value to us, but we believe that they also hold latent signatures of magic used by the old Empire.$B$BYou''ll more than likely discover three kinds of Paragons in Zul''Gurub: coins, bijous, and primal items.  Bring them to us in the quantities that we seek, and you''ll be rewarded with some of the finest items we Zandalar have ever crafted.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7634;
UPDATE `npc_text` SET `text0_0` = '*Whirr* *CLANK*$B$BI have been instructed to accept high quality rare fish and return valuable Nat Pagle fishing accessories.   Fish Requested.$B$B*THUMP* *Buzz*$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7641;
UPDATE `npc_text` SET `text0_0` = 'Heya Heya Heya!   If you want to test your fishing skills then I have just the place for you!   This Sunday we have a fishing tournament in Stranglethorn!$B$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7677;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Fishmaster Bassbait has had the waters here seeded with high quality Tastyfish so he can have his tournament.$B$BOnce he gets his winner, I will give you silver for each five Tastyfish you bring me!$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7696;
UPDATE `npc_text` SET `text0_0` = 'Well met master of Rod and Reel!   If you be willing to test your skills against the best fisher-folk in the lands then listen up!   On this very Sunday there be a contest in Stranglethorn where the master angler will be chosen!$B$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7712;
UPDATE `npc_text` SET `text0_0` = 'We already have a winner for our contest, but Jang is willing to purchase any Tastyfish that you have fished up!$B$BThere is always next Sunday for you to show your Angling skill!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7714;
UPDATE `npc_text` SET `text0_0` = 'We have more than one enemy in Silithus, $N.$B$BWhile everyone''s attention is focused on the silithid, my big brother and I have been keeping a close eye on the Twilight''s Hammer crazies.$B$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7797;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'I highly recommend that you visit Sayge to get your fortune told. I know, I know... he''s a gnoll.  But he''s a very special gnoll with the power to divine your future!$B$BAnd we are constantly expanding the faire with all manner of new attractions!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7799;
UPDATE `npc_text` SET `text0_0` = 'The tag on this present reads: "For ages 40 and up."',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8110;
UPDATE `npc_text` SET `text0_0` = 'What is the Brotherhood of the Light? Well... We are all members of the Argent Dawn at the core - members of the Argent Dawn that aren''t held in check by morals, guilt and useless human emotion. Consider us Scarlet Crusade minus the stupidity, lack of leadership, and blind zealotry.$B$BDon''t let the Scarlet Commander tell you otherwise.$B$BAnd don''t let Tyrosus know I said that... It would be a terrible shame if I had to brutally maim him should a brawl break out.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8353;
UPDATE `npc_text` SET `text0_0` = 'Enjoying the festival, $c?$b$bWhile the Flame Wardens tend to the fires of the present, I am more of a historian, keeping close the festivals past. I''m also, of course, documenting this year''s festivities. Things are going well thus far, don''t you think?$b$bYou know, $n, there is power inherent in all festival fires burning throughout the holiday. We''re taking care of ours, but I''m certain there are sacred flames burning deep within our enemy''s cities...',`text0_1` = 'Enjoying the festival, $c?$b$bWhile the Flame Wardens tend to the fires of the present, I am more of a historian, keeping close the festivals past. I''m also, of course, documenting this year''s festivities. Things are going well thus far, don''t you think?$b$bYou know, $n, there is power inherent in all festival fires burning throughout the holiday. We''re taking care of ours, but I''m certain there are sacred flames burning deep within our enemy''s cities...',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8703;
UPDATE `npc_text` SET `text0_0` = 'Finally, someone came down to talk to me!  Want to hear some of my rhymes?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9955;
UPDATE `npc_text` SET `text0_0` = 'Walking down the street!  Looking at my feet!  Watching the leaves, fall off of the trees!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9956;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Greetings, $N. My fellow Sons of Lothar and I have been stuck on this miserable world for close to twenty years now. We held on as best we could, but it still amazes me that the threats we face today are just the shadows of our past failures.$B$BPerhaps you will help us atone for them?  $B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8713;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Shattrath is more than a staging ground for war against the Burning Legion and Illidan.  It serves as a sanctuary to those seeking to escape the violence surrounding us.$B$BWe would be hypocrites if we turned the refugees away.$B$BIf your question refers to the Scryers, then I will respond that while I may not like them or their leader''s wild claims of visions of redemption, it is not for us to question the wisdom of the naaru.$B$BThese are difficult times, $N.  We need allies where we can find them.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9459;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = '"Born from light" would be a close translation for Sha''tar.  It is the name we gave to the naaru who reclaimed Shattrath City from the agents of Illidan.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9458;
UPDATE `npc_text` SET `text0_0` = 'As a mage, you are one of a select group that can conjure a portal to transport you back to this very place.  I can teach you if you are ready.',`text0_1` = 'As a mage, you are one of a select group that can conjure a portal to transport you back to this very place.  I can teach you if you are ready.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 5880;
UPDATE `npc_text` SET `text0_0` = 'To honor your elders is to honor your culture and your people, $c.  For this, the Coins of Ancestry serve as a tangible means to recognize those who choose to follow a venerable path of respect.$B$BDuring this Lunar Festival, you may have the opportunity to honor many elders.  As you do so, you will acquire the Coins of Ancestry.  Bring me these coins, and I will reward your diligence with a selection of unique items.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8202;
UPDATE `npc_text` SET `text0_0` = 'You don''t see too many apprentices around these parts, do you?  I''m beginning to think it''s because the magisters give us all the dangerous work they''d rather not do themselves.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8580;
UPDATE `npc_text` SET `text0_0` = 'Hello.  What brings you to Chillwind Camp today?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8846;
UPDATE `npc_text` SET `text0_0` = 'What could I have done to give the gods cause to lash out at me with such ferocity? All that I cherished is gone - dead or destroyed. My family taken from me by the brutes of the forest. My home razed. My ship sunk.$B$BI am a broken man, stranded on a broken island.$B$BPerhaps you are you here to finish the job? Make it quick, I will not resist. Take my life, stranger; I am too cowardly to do it myself. My hand shivers... the blade will not strike true.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8870;
UPDATE `npc_text` SET `text0_0` = 'How fares your search for the Mark?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8964;
UPDATE `npc_text` SET `text0_0` = 'Can''t you see that I''m busy?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8978;
UPDATE `npc_text` SET `text0_0` = 'I was the last to die. As I felt my spirit leaving my mortal shell, I swore a blood oath.$B$B<Prince Toreth shakes his head.>$B$BA pact was made between this land and I: My blood for this world. I became the sole keeper of the history of my people.$B$BI cannot rest until I am secure in knowing that the story of the dragon riders of Loreth''Aran is not lost in the passages of time.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9060;
UPDATE `npc_text` SET `text0_0` = 'I watched as they beat him without mercy. Their ruthless lieutenant acted as if such cruelty was an act of normalcy. Through the savage beatings, I could feel myself breaking.$B$BAs I watched Vindicator Saruan take their blows, I began to weep. Not out of fear... I wept out of sadness. To see a draenei of the Triumvirate treated in such a manner. If only I could have broken free of my bonds. If only...$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9079;
UPDATE `npc_text` SET `text0_0` = 'After what seemed an eternity, the Vindicator lost consciousness. The torture was too much, even for him. The cruel one - Matis as I found out he was called - attempted to wake Saruan by splashing contagion laced water across his ravaged body. But Saruan did not wake.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9080;
UPDATE `npc_text` SET `text0_0` = 'I wanted to scream but only a low gasp escaped my lips. I was promptly beaten for this act of rebellion. As I lay on the ground, I could see Matis pacing in front of Saruan''s body. He seemed visibly concerned. He stated that Sironas or Sirona or some such entity would have his flesh flayed from his bones if Saruan had perished in the beatings. $B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9081;
UPDATE `npc_text` SET `text0_0` = 'That the Sironas entity had plans for Saruan... $B$B<The writing stops abruptly and a long line scrolls off the page. This draenei died while making the entry.>$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9082;
UPDATE `npc_text` SET `text0_0` = 'It spoke to me of secrets and power, and also of truths. The Light had not forsaken the Broken! The fel energies that the orcs had wielded long ago against the draenei had infused us, causing a break in our ability to be heard by, or perhaps to hear, the Light. The same that had been responsible for the degradation of our bodies.$B$BBut our spirits were not broken, and the air offered to me another path, through which I might deliver my people.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9102;
UPDATE `npc_text` SET `text0_0` = 'Their day will come, $N.$B$BAnd when it does, I will be there.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9107;
UPDATE `npc_text` SET `text0_0` = 'Here lie the remains of Weeder Greenthumb, one of Watcher Jhang''s druid companions.  By all appearances he was killed quick and clean while trying to make his escape from the Slave Pens.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9118;
UPDATE `npc_text` SET `text0_0` = 'Sironas claims that certain eredar possess the ability to transform others of their race into man''ari. Draenei were supposedly once eredar and Sironas is a powerful eredar.$B$B<The agent laughs.>$B$BCan you believe it? These pathetic creatures were once all-powerful demons. What kind of fool rejects such power?$B',`text0_1` = 'Sironas claims that certain eredar possess the ability to transform others of their race into man''ari: Savage demonic beings. Draenei were supposedly once eredar and Sironas is a powerful eredar.$B$B<The agent laughs.>$B$BCan you believe it? These pathetic creatures were once all-powerful demons. What kind of fool rejects such power?$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9139;
UPDATE `npc_text` SET `text0_0` = 'This land has been ravaged by the crash. While you may not follow our philosophies, $c, I urge you to do whatever you can to aid in the healing process.',`text0_1` = 'This land has been ravaged by the crash. While you may not follow our philosophies, $c, I urge you to do whatever you can to aid in the healing process.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9194;
UPDATE `npc_text` SET `text0_0` = 'Do not be fooled by the ruins surrounding us, $c.  Dalaran is as powerful as ever.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9241;
UPDATE `npc_text` SET `text0_0` = 'A thick red slash has been drawn across the words WANTED: Deathclaw.  "This bounty has been claimed by the heroic $N, who has overcome the fearsome beast," declares more writing in the same red ink.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9245;
UPDATE `npc_text` SET `text0_0` = 'Garadar is in shambles, stranger. Since the Greatmother took ill, Garrosh has gone into a deep depression. He is most certainly not his father''s boy.$B$B<Kurkush sighs.>$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9271;
UPDATE `npc_text` SET `text0_0` = '<Lantresor glares at you as if he were looking through you.>$B$BPerhaps there is another way... I will agree to your leader''s demands, only if you do exactly as I ask.$B$BWith your assistance, we may be able to help each other out greatly.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9368;
UPDATE `npc_text` SET `text0_0` = 'You''re definitely strong, $r, but do you have what it takes to become the Warmaul champion?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9394;
UPDATE `npc_text` SET `text0_0` = 'The Burning Legion. Demons. I see them as clearly as you can see your own hand in front of your face. That is, I used to be able to see them clearly.$B$BWith the Legion''s return come new machinations. Under normal circumstances, I am able to sense the presence of a demon from a thousand paces.$B$B<Altruis grimaces.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9421;
UPDATE `npc_text` SET `text0_0` = 'They elude me. I cannot see past their defenses. They have put in place wards to prevent detection.$B$B<Altruis points westward.>$B$BThey fear us because they know that we fear nothing. The cost for such power is great, the sacrifices many. ',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9422;
UPDATE `npc_text` SET `text0_0` = '<Altruis turns to face you and smiles.>$B$BI do not.$B$B<Altruis points to his steed, Nethrandamus.>$B$BWe must stop them before these forge camps are able to complete whatever it is that they are building.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9423;
UPDATE `npc_text` SET `text0_0` = 'That is what these structures that litter the landscape are called. The Legion have employed the mo''arg and gan''arg to build weapons of mass destruction at these mobile forge camps. Let us not find out what it is that they intend to build here in Nagrand!$B$BYou will be my eyes. Your weapons will be my fury.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9424;
UPDATE `npc_text` SET `text0_0` = '<Floon makes a series of strange clicking and clucking sounds.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9442;
UPDATE `npc_text` SET `text0_0` = 'Are you serious? He already killed me! What more could he want?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9443;
UPDATE `npc_text` SET `text0_0` = 'You seek the hunters?  You will find them on the second level of the Trader''s Tier, in the Hall of the Hunt.',`text0_1` = 'You seek the hunters?  You will find them on the second level of the Trader''s Tier, in the Hall of the Hunt.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9544;
UPDATE `npc_text` SET `text0_0` = 'You can find Arthaid, our stable master, outside of the Caregiver Center. He is located on the upper level of the central hub, near the Exodar''s main entrance.',`text0_1` = 'You can find Arthaid, our stable master, outside of the Caregiver Center. He is located on the upper level of the central hub, near the Exodar''s main entrance.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9558;
UPDATE `npc_text` SET `text0_0` = 'The Exodar''s vaults are vast and well-protected. Your goods will come to no harm here.',`text0_1` = 'The Exodar''s vaults are vast and well-protected. Your goods will come to no harm here.',`text1_0` = 'We control access to the Exodar''s storage facilities. Are there goods you wish to store or remove?',`text1_1` = 'We control access to the Exodar''s storage facilities. Are there goods you wish to store or remove?',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9567;
UPDATE `npc_text` SET `text0_0` = 'In my years as a member of Explorers'' League, I''ve been all over Azeroth, but I''ve never seen anythin'' quite like Bloodmyst. ',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9586;
UPDATE `npc_text` SET `text0_0` = 'My sister Silanna is naive to the growing danger in these woods. But like it or not, as soon as I get this wagon loaded we''re moving within the city walls. $b$bIt appears that I''ve got more bags here than I need. Perhaps you could make use of them.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9630;
UPDATE `npc_text` SET `text0_0` = 'The Illidari demons keep me here because of my knowledge of ancient draenei crystals and relics.$B$BThey''ve enslaved many of my people and use us to look for a powerful crystal... one that in all likelihood is not even here.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9787;
UPDATE `npc_text` SET `text0_0` = 'What for?  If Illidan''s demons don''t catch me and enslave me again, then the naga of Zangarmarsh will.$B$BJoining Illidan and his allies has turned out to mean nothing but slavery to most of the Broken tribes.  There is no hope for my people.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9788;
UPDATE `npc_text` SET `text0_0` = 'Only this book survived the cataclysm that destroyed their world.  Those proud and foolish men who thought to control a cosmic being of untold power.$B$BWould you, the possessor of the codex, do the same?$B$BHave you devised a foolproof method to summon forth Murmur, or any of the other entities cautiously whispered of in these unhallowed pages?$B$BWe shall see.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9840;
UPDATE `npc_text` SET `text0_0` = 'That child gives me chills. He stands there all day long communing with his grandfather. He''ll then turn to tell his mother what the grandfather told him and she - of course - just smiles and nods her head.$B$BLambs! Lemmings! All of them!$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9914;
UPDATE `npc_text` SET `text0_0` = 'Many years ago, my men and I followed the wizard Khadgar and the paladin Turalyon to this world. Our sole aim was to annihilate the orcs and their vile kin. Yet something went terribly wrong in the final hours of our war.$B$BUltimately, this dark world was ripped asunder - and my dear friends were lost to the void.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9932;
UPDATE `npc_text` SET `text0_0` = 'What do you know about ethereals, fleshling?$B$BYou undoubtedly view us all in the same light, oblivious to the conflicts and struggles between the differing factions.$B$BPerhaps it is time for an introduction. I am Commander Ameer of the Protectorate - also your only hope of resolving the infestation of both void creature and Ethereum in this area.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10058;
UPDATE `npc_text` SET `text0_0` = 'The spirit of water has left us.  Our tribe is doomed.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10103;
UPDATE `npc_text` SET `text0_0` = 'The winds do not speak to our tribe anymore, $N.  My people are lost without elders to bring the spirits to them.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10104;
UPDATE `npc_text` SET `text0_0` = 'These chains that bind me prevent me from bringing the spirit of fire to my people, $N.  Souls without fire are souls that cannot rebel against their masters.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10105;
UPDATE `npc_text` SET `text0_0` = 'The Silverwing Sentinels still fight the Horde in Warsong Gulch, $c. What remains to be seen is if you will return there to help them.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10286;
UPDATE `npc_text` SET `text0_0` = 'Thanks for getting me out of there. I owe you one!',`text0_1` = NULL,`text1_0` = 'I should be able to get out here now. Thanks!',`text1_1` = NULL,`text2_0` = 'This place is crazy! I could spend years here investigating all this technology!',`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10373;
UPDATE `npc_text` SET `text0_0` = '<The water elemental is ready to surge.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10413;
UPDATE `npc_text` SET `text0_0` = '<The grunt''s mouth waters, anticipating bloodshed.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10425;
UPDATE `npc_text` SET `text0_0` = 'All rewards for services rendered to be dispensed by Warcaller Beersnout.$B$BPost no bills.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10449;
UPDATE `npc_text` SET `text0_0` = 'Prospecting is the primary method of finding gems!   You simply use the prospecting ability (which is found in the general tab of your spellbook) on a stack of five ore to extract the gems from it.   Any type of non-precious ore will do!    $B$BBetter quality ores will provide more valuable gems so you will find higher quality gems in iron ore than in copper ore.',`text0_1` = 'Prospecting is the primary method of finding gems!   You simply use the prospecting ability (which is found in the general tab of your spellbook) on a stack of five ore to extract the gems from it.   Any type of non-precious ore will do!    $B$BBetter quality ores will provide more valuable gems so you will find higher quality gems in iron ore than in copper ore.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10452;
UPDATE `npc_text` SET `text0_0` = 'If it''s a hammer you''re looking for,  you''ve come to the right place.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10468;
UPDATE `npc_text` SET `text0_0` = 'Ah, another $c looking to be a gladiator, eh? Good!$B$BI sell the arena team charters you''ll need to participate in ranking Steamwheedle Fighting Circuit matches.',`text0_1` = 'Ah, another $c looking to be a gladiator, eh? Good!$B$BI sell the arena team charters you''ll need to participate in ranking Steamwheedle Fighting Circuit matches.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10608;
UPDATE `npc_text` SET `text0_0` = 'Success!  I have attuned myself to Hellfire Citadel and the magic within.  Ah, such power!$B$BThere are countless fel orcs in that place... but that is not all!  I sense demonic power within those walls as well...$B$BIf you open yourself, then I shall grasp your mind -- briefly, mind you -- and take quill to parchment and record my findings for you...',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10643;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $C.  If I might be so bold, may I remind you that -- while I attune myself to the magics of Hellfire Citadel -- there will undoubtedly be Hellfire wardens biting at my proverbial heels!$B$BSo, do be an upstanding member of your Horde and play the part of the hero... and protect me!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10659;
UPDATE `npc_text` SET `text0_0` = 'They fear my words. They make an example out of me. A mockery of the one true god, Neptulon.$B$B<Skar''this spits.>$B$BRetribution comesss, mortal. The glorious hand of the Tidehunter will one day sweep through the non-believers like a scythe against a new harvest.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10676;
UPDATE `npc_text` SET `text0_0` = 'I am Zarevhi of the Consortium.  My skills as a transmuter are known in a thousand worlds.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10687;
UPDATE `npc_text` SET `text0_0` = 'You do not have enough reputation with or have not pledged allegiance to The Scryers.',`text0_1` = 'You do not have enough reputation with or have not pledged allegiance to The Scryers.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10723;
UPDATE `npc_text` SET `text0_0` = 'If you haven''t already, make sure that you offer your assistance to Rina Moonspring.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10246;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'You''ll be purchasing no hawkstrider here until you''ve proven your worth and dedication to our people.$b$B$BDo not return until you are considered exalted among the blood elves. Away with you!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10305;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'I''ve done my time in the trenches, and spent many years training the pups. It''s good to be home. No matter what has become of it, this is my home.',`text1_0` = NULL,`text1_1` = 'To care for these fearless beasts, who stand between my clanmates and death, is an honor.',`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10339;
UPDATE `npc_text` SET `text0_0` = '<Dark magic ripples from the necrolyte.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10434;
UPDATE `npc_text` SET `text0_0` = '<Warchief Blackhand towers over the field.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10442;
UPDATE `npc_text` SET `text0_0` = 'Be gone, mortal! Your kind is unwelcome here...',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10496;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10503;
UPDATE `npc_text` SET `text0_0` = 'To pass beyond my Hall, you must defeat me in a game of skill!  Control your king when you are ready to begin...',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10506;
UPDATE `npc_text` SET `text0_0` = 'You will find a caregiver center in the southern portion of Aldor Rise.',`text0_1` = 'You will find a caregiver center in the southern portion of Aldor Rise.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10525;
UPDATE `npc_text` SET `text0_0` = 'I detect a charge in your paranarbulatric region!  You must have used the Zephyrium Capacitorium lately -- you can''t use it again until the charge wears off...',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10537;
UPDATE `npc_text` SET `text0_0` = 'If you''re seeking patterns or knowledge about shadoweave tailoring, I''d be happy to help you.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10673;
UPDATE `npc_text` SET `text0_0` = 'The Sons of Gruul must be defeated if we are to shake off our shackles and live as free ogres once more!$B$BWe must work quietly, yet quickly, if our underground resistance is to have a chance of success.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10800;
UPDATE `npc_text` SET `text0_0` = 'I don''t care who you are or what you do outside of the Skyguard, but while you''re here you will do as you''re told.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10819;
UPDATE `npc_text` SET `text0_0` = 'As a relative newcomer to Ogri''la, you don''t have enough exposure to the crystals here to reap their full benefits.  Besides, you only have one head.$B$BWe, on the other hand, have been here a very long time.  So, as you can imagine, we''re fairly well-versed in a great many things.$B$BOf late, we''ve taken a keen interest in the demons of the forge camps.  More specifically, we''ve devised a way to rid us of them for good.$B$BAt least, that''s the theory.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10919;
UPDATE `npc_text` SET `text0_0` = 'Have you come to hurt me?  I have nothing to do with the war, $r.$B$BI''m just a sickly scholar, please leave me alone!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10930;
UPDATE `npc_text` SET `text0_0` = 'The crystal foci?  Of course we''ll explain it seeing as you only have half the brain power to figure it out.$B$BA depleted crystal focus can be combined with ten apexis shards in a simple process, which creates a charged crystal focus.  These charged foci have some healing properties, but more important is their use with a possessed demon.$B$BYou see, the charged focus can be used to enable a possessed demon to exhibit special powers.  After a time, Gahk will have a mission for you to do just that.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11094;
UPDATE `npc_text` SET `text0_0` = 'Can''t you see that I''ve got places to go and people to see! Step aside, peasant!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11215;
UPDATE `npc_text` SET `text0_0` = 'When you get a ram, you also get the reins. These aren''t your grandma''s reins though, you''ve gotta use them!$b$bJust loosen up on the reins a few times to build up some speed.  Keep on loosening up and GIDDYUP!  You''ll be flying!$b$bBut the faster he goes the quicker he''ll get tired. So you have to be careful.$B',`text0_1` = 'When you get a ram, you also get the reins. These aren''t your grandma''s reins though, you''ve gotta use them!$b$bJust loosen up on the reins a few times to build up some speed.  Keep on loosening up and GIDDYUP!  You''ll be flying!$b$bBut the faster he goes the quicker he''ll get tired. So you have to be careful.$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12085;
UPDATE `npc_text` SET `text0_0` = 'Keeping your ram in a canter or gallop for too long will exhaust him. If you want your ram to recover a bit, let him walk or trot. If there are apple bushels around, take him there to recover.$B$B',`text0_1` = 'Keeping your ram in a canter or gallop for too long will exhaust him. If you want your ram to recover a bit, let him walk or trot. If there are apple bushels around, take him there to recover.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12087;
UPDATE `npc_text` SET `text0_0` = 'Ram racing is easier than it seems, but it takes skill to master. Just use the reins, eat apples if you can and avoid exhausting your ram.$B$B',`text0_1` = 'Ram racing is easier than it seems, but it takes skill to master. Just use the reins, eat apples if you can and avoid exhausting your ram.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12088;
UPDATE `npc_text` SET `text0_0` = 'Next to the beer and sausage, the most popular part of Brewfest is the souvenirs! From traditional holiday garb to mini-kegs of tasty brew, all sorts of Brewfest-themed items are available from Belbi Quikswitch. Just be sure to have plenty of Brewfest Prize Tokens on hand, as it''s the only way to buy them! You can earn prize tokens by helping out around the Brewfest Grounds.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12155;
UPDATE `npc_text` SET `text0_0` = 'Ram racing is one of the great traditions of Brewfest. Speak to Pol Amberstill down by the ram stable if you want to learn more. It''s a right hoot AND can be a great way to earn Brewfest Prize Tokens!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12156;
UPDATE `npc_text` SET `text0_0` = 'Everyone loves those crazy Brewfest racing rams. Want to know more? Talk to Driz Tumblequick down by the ram stable. Have a blast and earn some Brewfest Prize Tokens while you''re at it!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12159;
UPDATE `npc_text` SET `text0_0` = 'Hey hey, don''t forget to grab yourself some Brewfest souvenirs! We got everything from traditional holiday garb to mini-kegs of tasty brew. Just talk to Blix Fixwidget, but make sure you got plenty of Brewfest Prize Tokens on hand... it''s the only way to buy them! You can earn prize tokens by helping out around the Brewfest Grounds.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12160;
UPDATE `npc_text` SET `text0_0` = 'I''ll tell ya, the only proper way to hunt is when yer good an'' goggled!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12165;
UPDATE `npc_text` SET `text0_0` = 'You ever tried on Synthebrew Goggles? They''re surprisingly uncomfortable!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12181;
UPDATE `npc_text` SET `text0_0` = 'Twice a day, at six fifteen in the morning and six fifteen in the evening, Shadow Hunter Vol''jin himself comes out to the Brewfest grounds for the Tapping of the Keg ceremony. You''d be a fool to miss it!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12196;
UPDATE `npc_text` SET `text0_0` = 'Can''t you see that I''m trying to have a conversation with the lady?  Oh, very well, she seems preoccupied anyway.$B$BI deal in only the finest drinks, both local and exotic in vintage.  Care to have a look?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8549;
UPDATE `npc_text` SET `text0_0` = 'Romus informed me of the tragedies that beset my beautiful city. There are no fitting words for the sorrow I felt upon hearing of Lordaeron''s fate - and the fate of my own, beloved Stromgarde.$B$BTwenty years ago, no one had heard of the ''Burning Legion''... Damn those cursed devils!$BRest assured, $N; should I ever return to Azeroth, Stromgarde will once more rise as a force of reckoning. This I swear...',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8772;
UPDATE `npc_text` SET `text0_0` = 'Strength to the Clans, $c!  What brings you here?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8811;
UPDATE `npc_text` SET `text0_0` = 'Don''t be alarmed... while my gryphons may not be entirely alive, they will still carry you faithfully to your destination. Tell me... which tower do you seek?',`text0_1` = 'Don''t be alarmed... while my gryphons may not be entirely alive, they will still carry you faithfully to your destination. Tell me... which tower do you seek?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8834;
UPDATE `npc_text` SET `text0_0` = 'Good day to you, $c.$B$BI''m waiting to hear from one of the High Thane''s advisors about an audience. It was a struggle just to get the opportunity to present my credentials.$B$BI''ve heard the Wildhammer described as ''wary of outsiders,'' but that''s proven to be quite an understatement.  Hopefully, things will improve once I''ve had the opportunity to meet with Featherbeard, whom I''m told favors closer ties with the Alliance.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8847;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Wow, you totally bombed out there. Let''s think of that as a rehearsal, shall we? Ready to go out again?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8975;
UPDATE `npc_text` SET `text0_0` = 'Hail, champion. The tale of your deeds will be told throughout the ages. Perhaps one day, a statue of you will stand amongst the heroes of Stormwind.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9066;
UPDATE `npc_text` SET `text0_0` = 'Why you mean to Lump? Lump hungry, dat''s all.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9352;
UPDATE `npc_text` SET `text0_0` = 'OK! Lump tell you anything you want!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9353;
UPDATE `npc_text` SET `text0_0` = 'Boulderfist hungry! Need food! Warmaul ogre tribe kick Boulderfist out of mound to north. Many more Boulderfist to feed now.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9354;
UPDATE `npc_text` SET `text0_0` = 'Dat not true. Me just want to nibble. I don''t eat all. Ok, maybe I eat da little ones.$B$BDey so delicious!$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9355;
UPDATE `npc_text` SET `text0_0` = '<Lump shrugs.>$B$BYou bring da war to da Boulderfist. We put it in da stew.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9356;
UPDATE `npc_text` SET `text0_0` = 'Get me out of here, $r!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9357;
UPDATE `npc_text` SET `text0_0` = 'All muscle and no brain, that''s what peons are! They''re great when you can motivate them, but they have to be ''kick'' started, if you know what I mean.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9642;
UPDATE `npc_text` SET `text0_0` = 'I have just the thing you need to cast your spell.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9647;
UPDATE `npc_text` SET `text0_0` = 'We''re here to protect Gadgetzan interests in Un''Goro and that''s none of your business.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9774;
UPDATE `npc_text` SET `text0_0` = 'That Shaffar is a clever one. He''s rigged the entrance with some sort of ward to prevent other ethereal groups from entering. We''re working on breaking through his defenses so we can get in there and take what''s ours. I''ve got top ethereals working on this around the clock. We''ll have it open any minute now. I can feel it...',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9897;
UPDATE `npc_text` SET `text0_0` = 'It''s my passion, you know. In life and in death, armorcrafting is what I love. Please, treat me as if I were a living draenei, stranger. Let me know what it is to feel again... Allow me the honor of repairing your items.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9936;
UPDATE `npc_text` SET `text0_0` = 'Ah, a new champion to aid our cause? What say you, $N? $B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9938;
UPDATE `npc_text` SET `text0_0` = 'I will accept your help in this inspection, $c. Do not assume that I will trust your findings or your motives without my own verification.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11128;
UPDATE `npc_text` SET `text0_0` = 'I run the tightest airship in Azeroth. She used to be fitted with twin light cannons and enough bombs to flatten a city, you know... her mere shadow was enough to rout armies.$b$bWhat? Of course it''s true!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12318;
UPDATE `npc_text` SET `text0_0` = 'In Outland, our forces fight against the Horde to control the Eye of the Storm. It is dangerous, fighting amidst the raging energies of the Nether. Do you have what it takes to join us?',`text0_1` = 'In Outland, our forces fight against the Horde to control the Eye of the Storm. It is dangerous, fighting amidst the raging energies of the Nether. Do you have what it takes to join us?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10558;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'A mage... you seek to learn the magic of portals, yes?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10292;
UPDATE `npc_text` SET `text0_0` = 'Your name is beginning to be revered around here.$B$B<Chu''a''lor''s left eye pierces you with its stony gaze.>$B$BKeep up the good work, $N!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11010;
UPDATE `npc_text` SET `text0_0` = 'Forgetting your skill in Transmutation Mastery is not something to do lightly.$B$BAre you absolutely sure?',`text0_1` = 'Forgetting your skill in Transmutation Mastery is not something to do lightly.$B$BAre you absolutely sure?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11076;
UPDATE `npc_text` SET `text0_0` = 'Wait, don''t tell me... $n, right?$b$bWhat can I do for you?$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11313;
UPDATE `npc_text` SET `text0_0` = 'My brother Krixx thinks he has it bad working in Orgrimmar. Nothing compares to the stench of this place. At least the boss had the decency to give me hazard pay!$B$BWhat? Do you want to see where the zeppelin is? Good thing I''ve got my zeppelin tracker right here!',`text0_1` = 'My brother Krixx thinks he has it bad working in Orgrimmar. Nothing compares to the stench of this place. At least the boss had the decency to give me hazard pay!$B$BWhat? Do you want to see where the zeppelin is? Good thing I''ve got my zeppelin tracker right here!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11234;
UPDATE `npc_text` SET `text0_0` = 'The grand master leatherworker Darmari may be found in the lower city''s open marketplace.',`text0_1` = 'The grand master leatherworker Darmari may be found in the lower city''s open marketplace.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10522;
UPDATE `npc_text` SET `text0_0` = 'Elder Wheathoof is enjoying the vistas above Mulgore at Thunder Bluff.',`text0_1` = 'Elder Wheathoof is enjoying the vistas above Mulgore at Thunder Bluff.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8188;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'It''s so lovely to see you again, $N! I really can''t thank you enough for delivering that message to my dear little gnome.$B$BWould you like to hear a song? It will make traveling in the rough seas much easier!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7916;
UPDATE `npc_text` SET `text0_0` = 'This is a portal to the Warsong Gulch battleground.',`text0_1` = 'This is a portal to the Warsong Gulch battleground.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13579;
UPDATE `npc_text` SET `text0_0` = 'There''s always a need for more kegs at Brewfest!$b$bI''ll lend you the reins to one of my personal rams.$b$bEvery time you bring me a keg, I''ll give you some tokens.  I''ll even let you use the ram for a bit longer for every keg you bring me!  $B$BTake heed! Once you start this, you won''t be able to do it again until tomorrow.$B$BAre you sure you''re ready to do this?',`text0_1` = 'There''s always a need for more kegs at Brewfest!$b$bI''ll lend you the reins to one of my personal rams.$b$bEvery time you bring me a keg, I''ll give you some tokens.  I''ll even let you use the ram for a bit longer for every keg you bring me!  $B$BTake heed! Once you start this, you won''t be able to do it again until tomorrow.$B$BAre you sure you''re ready to do this?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12076;
UPDATE `npc_text` SET `text0_0` = 'The Dread Captain DeMeza has pulled into Booty Bay and declared it Pirates'' Day!$B$BShe''s making anyone who''s brave enough to share a drink with her an honorary crewmember.',`text0_1` = 'The Dread Captain DeMeza has pulled into Booty Bay and declared it Pirates'' Day!$B$BShe''s making anyone who''s brave enough to share a drink with her an honorary crewmember.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13044;
UPDATE `npc_text` SET `text0_0` = 'Is your cause righteous and your heart true? If so, you are welcome here - among the druids for the ethical and humane treatment of animals. So long as you do not veer down the dark path of depravity and harm the animals that have allowed us to coexist within their world, D.E.H.T.A. will consider you an ally.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12485;
UPDATE `npc_text` SET `text0_0` = 'The dead rise and seek vengeance on any that dare pass through their domain. Turn back!$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12221;
UPDATE `npc_text` SET `text0_0` = 'I''m out of my element, eh? Walt doesn''t know what he''s talking about! I single-handedly kicked the iron out of these dwarves and set up camp to observe the goings-on of the dig site.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12189;
UPDATE `npc_text` SET `text0_0` = 'The Assurance has somehow become inundated with bugs and we are unable to set sail to Northrend.',`text0_1` = NULL,`text1_0` = 'We were all set to sail into Northrend, but we''ve noticed a severe number of pests aboard our ship.',`text1_1` = NULL,`text2_0` = 'Before we can set sail to Northrend, we''ve got to eliminate our pest problem aboard the Assurance.',`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14056;
UPDATE `npc_text` SET `text0_0` = 'We, the Sons of Lothar, have remained here ever since - fighting... dying... praying that a day like today would come - a day when the Portal would open and our brothers would come to deliver us home.$B$BOverjoyed as we are, duty still calls. There is much to be done before we can depart this world and take our rest.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9933;
UPDATE `npc_text` SET `text0_0` = 'Orcs. It seems I''ve been fighting them all my life.$B$BTwenty years ago we shattered the Horde and tore down the walls of their Hellfire Citadel. We drove the vile greenskins to the very brink! After that, other than a few skirmishes the broken orcs never again posed a threat to us.$B$BUntil now. $B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9941;
UPDATE `npc_text` SET `text0_0` = 'Pet families come in one of three types. Ferocious pets, like cats, can dish out damage but can''t take it as well. Tenacious pets, like turtles, are more defensive and can occupy an enemy''s attention while you stay at range. Cunning pets, like spiders, have a mix of offensive and defensive abilities and are particularly useful in Battlegrounds and Arenas.$b$bAs your pet gains more experience, it can learn new talents just like you can, but at a slower rate. If you ever want to change your pet''s talents, just come back to me.',`text0_1` = 'Pet families come in one of three types. Ferocious pets, like cats, can dish out damage but can''t take it as well. Tenacious pets, like turtles, are more defensive and can occupy an enemy''s attention while you stay at range. Cunning pets, like spiders, have a mix of offensive and defensive abilities and are particularly useful in Battlegrounds and Arenas.$b$bAs your pet gains more experience, it can learn new talents just like you can, but at a slower rate. If you ever want to change your pet''s talents, just come back to me.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13474;
UPDATE `npc_text` SET `text0_0` = 'How may I help you?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13702;
UPDATE `npc_text` SET `text0_0` = 'Look around and let the devastation sink in, $c. Every last troll that lived here is either dead or has fled to the upper levels.$B$BIt gets worse.$B$BIn an act of desperation, the living Drakkari trolls sacrificed their own animal gods so that they could drink from the blood of the gods and gain untold power. While they succeeded in keeping the Scourge at bay with their newfound strength, the results were catastrophic. The ancient empire of Zul''Drak lies in ruin as proof.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13615;
UPDATE `npc_text` SET `text0_0` = 'Amongst the Kirin Tor, it is my duty to see to the strategic interests of the magocracy.$B$BThere is much yet to be done this week. Will you assist me, $N?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13979;
UPDATE `npc_text` SET `text0_0` = 'I foresee that you will speak with Archmage Lan''dalock, $N.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14017;
UPDATE `npc_text` SET `text0_0` = 'We discovered these proto-drakes at the Bronze Dragonshrine in the Dragonblight. We knew at once that they were kin - our blood from ages past.$B$BMy apologies, $c. You are probably confused. I am Penumbrius of the bronze dragonflight. I have taken this form out of convenience. It is much easier to communicate and live amongst mortals while in the mortal guise.$B$BHow can I help you?$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13797;
UPDATE `npc_text` SET `text0_0` = 'Fear has always been our greatest weapon. Entire wars have been won and lost upon the shifting shoulders of trepidation and doubt. So how, then, does one fight an enemy that knows no fear?$B$B<Saurfang shakes his head.>$B$BWe do not just fight the Scourge in Northrend, we fight to gain control of our senses before they tear us apart...$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12381;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BWhen the Alliance controls Wintergrasp Fortress, I will open a portal for those who wish to travel there.$B$BThe next battle begins in $3975w:$3976w$3782w:$3784w$3785w.',`text0_1` = 'Greetings, $c.$B$BWhen the Alliance controls Wintergrasp Fortress, I will open a portal for those who wish to travel there.$B$BThe next battle begins in $3975w:$3976w$3782w:$3784w$3785w.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14083;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BWhen the Horde controls Wintergrasp Fortress, I will open a portal for those who wish to travel there.$B$BThe next battle begins in $3975w:$3976w$3782w:$3784w$3785w.',`text0_1` = 'Greetings, $c.$B$BWhen the Horde controls Wintergrasp Fortress, I will open a portal for those who wish to travel there.$B$BThe next battle begins in $3975w:$3976w$3782w:$3784w$3785w.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14084;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BThe Horde now controls Wintergrasp Fortress. Use the portal, if you like.$B$BThe next battle begins in $3975w:$3976w$3782w:$3784w$3785w.',`text0_1` = 'Greetings, $c.$B$BThe Horde now controls Wintergrasp Fortress. Use the portal, if you like.$B$BThe next battle begins in $3975w:$3976w$3782w:$3784w$3785w.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14086;
UPDATE `npc_text` SET `text0_0` = 'Barber? That is Naznik! He on top floor of Trade Quarter, near bank.',`text0_1` = 'Barber? That is Naznik! He on top floor of Trade Quarter, near bank.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13891;
UPDATE `npc_text` SET `text0_0` = 'The ancient tomes are always found near inscription trainers.',`text0_1` = 'The ancient tomes are always found near inscription trainers.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14174;
UPDATE `npc_text` SET `text0_0` = 'The razing of Orgrimmar was not just an attack against orcs, it was an affront to the Horde. An assault against our very existence!$B$BThe Lich King sought to sow the seeds of fear.$B$BThis...$B$B<Garrosh points to the fortified walls that surround him.>$B$BThis is the result of Arthas''s campaign.$B$BThe Horde fears nothing...$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12373;
UPDATE `npc_text` SET `text0_0` = 'Through the valleys and peaks of Mount Hyjal, across the shifting sands of Silithus, against the Legion''s dread armies - we have fought. We are the nameless, faceless, sons and daughters of the Alliance. By the Light and by the might of the Alliance, the first strike belongs to us and the last strike is all that our enemies see.$B$BWe are 7th Legion.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12739;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'We are quickly learning the price of death in this frigid wasteland, $N. The Lich King''s power extends across every inch of Northrend, permeating into the earth itself! He turns our own fallen people against us.$B$BFrom the sky, risen gryphon riders rain down their vengeful stormhammers as the walking dead assail us on the ground.$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12823;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Belgaristrasz speaks the truth; the situation is grave indeed.  $B$BI can grant you the power to call upon a drake from the Green Fight.  Speak to Belgaristrasz or Eternos if you prefer to draw on the power of the Red or the Bronze.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12915;
UPDATE `npc_text` SET `text0_0` = 'Varos Cloudstrider and his ring guardians protect the second ring.  Your drakes are more than a match for the Ring Guardians, but Varos stands behind an impenetrable shield created from the energy of the Oculus itself.  Ten Centrifuge Constructs power the shield from the ring and platforms above.  Destroy them and Varos will be vulnerable.$B$BI can grant you the power to call upon a drake from the Red Fight.  Speak to Eternos or Verdisa if you prefer to draw on the power of the Bronze or the Green.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12916;
UPDATE `npc_text` SET `text0_0` = 'Belgaristrasz speaks the truth; time is running out!$B$BI can grant you the power to call upon a drake from the Bronze Fight.  Speak to Belgaristrasz or Verdisa if you prefer to draw on the power of the Red or the Green.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12917;
UPDATE `npc_text` SET `text0_0` = 'Your greatest challenge lies ahead.  Ley-Guardian Eregos is a Blue dragon of immense power. You will find him flying above the uppermost ring. $B$BThe full power of your drakes has been unlocked.  Use their power to defeat Eregos!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13238;
UPDATE `npc_text` SET `text0_0` = 'Ruby Drakes excel at mitigating damage and protecting their allies.$B$BUsing Searing Wrath, they can breathe streams of liquid fire that jump from target to target, dealing increasing damage with each jump.$B$BWhenever a Ruby drake is damaged by an enemy attack, it gains an Evasive charge.  These charges can be used to perform a series of evasive maneuvers, allowing the drake to dodge incoming attacks and spells for a time.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13254;
UPDATE `npc_text` SET `text0_0` = 'Amber Drakes excel at dealing damage by manipulating time to their advantage.$B$BUsing Shock Lance, they can disrupt the flow of time around an enemy target, instantly damaging it.  The power of this effect is dramatically increased by Shock Charges on the target.$B$BWhen threatened, an Amber Drake can briefly stop the flow of time for its enemies.  This time disruption stores a large amount of Shock Energy on affected targets in the form of Shock Charges.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13256;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Emerald Drakes excel at healing themselves while poisoning their enemies.$B$BUsing Leeching Poison, they can steal health from their enemies.  Repeated applications of this poison can increase the effect.$B$BWith Touch the Nightmare, Emerald Drakes can reach into the Dream, converting a portion of their life energy into a highly damaging attack that leaves the target weakened, reducing its damage for a short time.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13258;
UPDATE `npc_text` SET `text0_0` = 'Belgaristrasz speaks the truth; time is running out!$B$BThe full power of your drakes has been unlocked.  Use their power to defeat Eregos!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13268;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Belgaristrasz speaks the truth; the situation is grave indeed.  $B$BThe full power of your drakes has been unlocked.  Use their power to defeat Eregos!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13269;
UPDATE `npc_text` SET `text0_0` = 'Ahunae''s axe will be the end of the Drakkari.$B$BYou be takin'' care of any that get past my axe!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13234;
UPDATE `npc_text` SET `text0_0` = 'There are two zeppelin towers outside Orgrimmar. The eastern tower serves Tirisfal Glades and Stranglethorn Vale, while the western tower serves Northrend and Thunder Bluff.',`text0_1` = 'There are two zeppelin towers outside Orgrimmar. The eastern tower serves Tirisfal Glades and Stranglethorn Vale, while the western tower serves Northrend and Thunder Bluff.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13310;
UPDATE `npc_text` SET `text0_0` = 'We will ravage the living... I mean the Scourge, of course.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 12751;
UPDATE `npc_text` SET `text0_0` = 'Isn''t it just beautiful? Can you see the potential profit?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14177;
UPDATE `npc_text` SET `text0_0` = 'Mortals, I am indebted to you for freeing me from the terrible corruption that besets this place. Though I have not yet recovered fully, I can help you battle Yogg-Saron.$B$BI can grant you and your friends the Speed of Invention, increasing your damage and movement speed. In addition, I can destabilize the matrices of certain Saronite based life-forms, reducing their attack and casting speeds.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14334;
UPDATE `npc_text` SET `text0_0` = 'Mortals, I am indebted to you for freeing me from the terrible corruption that besets this place. Though I have not yet recovered fully, I can help you battle Yogg-Saron.$B$BI can grant you and your friends the Fortitude of Frost, increasing your damage and reducing damage taken from enemy attacks. Should one of you be about to fall in battle, I can freeze you in a block of ice, protecting you from all damage for a short time. Know that this ability taxes my power, and I must rest after using it.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14326;
UPDATE `npc_text` SET `text0_0` = 'Mortals, I am indebted to you for freeing me from the terrible corruption that besets this place. Though I have not yet recovered fully, I can help you battle Yogg-Saron.$B$BI can grant you and your friends the Fury of the Storm, increasing your damage and maximum health. Should you be faced with evil so malevolent that it cannot be destroyed, I can channel all my power into a final Titanic Storm that will destroy even Immortals.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14333;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BThe Alliance currently control Wintergrasp Fortress.  When the battle is about to begin, talk to me to enter the battle.$B$BThe next battle begins in $4354k.',`text0_1` = 'Greetings, $c.$B$BThe Alliance currently control Wintergrasp Fortress.  When the battle is about to begin, talk to me to enter the battle.$B$BThe next battle begins in $4354k.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14782;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BThe Alliance currently control Wintergrasp Fortress, but the next battle starts soon.   Get ready to head to Wintergrasp and support our forces!$B$BThe next battle begins in $4354k.',`text0_1` = 'Greetings, $c.$B$BThe Alliance currently control Wintergrasp Fortress, but the next battle starts soon.   Get ready to head to Wintergrasp and support our forces!$B$BThe next battle begins in $4354k.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14791;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BThe Horde currently control Wintergrasp Fortress, but the next battle starts soon.   Get ready to head to Wintergrasp and support our forces!$B$BThe next battle begins in $4354k.',`text0_1` = 'Greetings, $c.$B$BThe Horde currently control Wintergrasp Fortress, but the next battle starts soon.   Get ready to head to Wintergrasp and support our forces!$B$BThe next battle begins in $4354k.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14790;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Ahoy! It''s Pirates'' Day, ye know... and ''til the sun rises on the morrow, Booty Bay is MINE$B$BSo! What do ye say? Raise a drink ta me and me crew, and join the celebration?.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13059;
UPDATE `npc_text` SET `text0_0` = 'Tomorrow, the baron gets his town back... but for today - Pirates'' Day - it belongs to the Dread Captain DeMeza and her crew. Yarrr!$B$BAnd remember: lookin'' the part''s only HALF the celebration. Talk like a pirate, $glad:lass,!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13056;
UPDATE `npc_text` SET `text0_0` = 'SQUAWK! Keelhaul the lad! Keelhaul!',`text0_1` = NULL,`text1_0` = 'SQUAWK! Walk the plank! Walk!',`text1_1` = NULL,`text2_0` = 'SQUAWK! Shiver me timbers! Shiver!',`text2_1` = NULL,`text3_0` = 'SQUAWK! Avast, ye scurvy dogs! Avast!' WHERE `ID` = 13058;
UPDATE `npc_text` SET `text0_0` = 'Greetings, $c.$B$BThe Horde currently control Wintergrasp Fortress.  When the battle is about to begin, talk to me to enter the battle.$B$BThe next battle begins in $4354k.',`text0_1` = 'Greetings, $c.$B$BThe Horde currently control Wintergrasp Fortress.  When the battle is about to begin, talk to me to enter the battle.$B$BThe next battle begins in $4354k.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14775;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'This is awful! I shouldn''t be sitting here, useless, when there''s so much to be done! If only my arm hadn''t gotten injured up in Northrend... No use dwelling on it, though! Tahu will have me patched up and cured eventually, and we''ll still help around here in the meantime.$B$BJust because we''re not at the front doesn''t mean we can''t help out somehow.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14561;
UPDATE `npc_text` SET `text0_0` = 'Mortals, I am indebted to you for freeing me from the terrible corruption that besets this place. Though I have not yet recovered fully, I can help you battle Yogg-Saron.$B$BI can grant you and your friends the Resilience of Nature, increasing your damage and increasing healing taken from spells and effects. In addition, I can conjure Sanity Wells that will allow you to recover your Sanity when your grip on reality falters.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14332;
UPDATE `npc_text` SET `text0_0` = 'A mere three hundred years ago, a reckless dwarf named Thaurissan summoned the master from his fiery realm. His return to this paltry world devastated the surrounding lands and created this volcanic Core. Mighty Ragnaros has slept under this mountain ever since. $B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 5011;
UPDATE `npc_text` SET `text0_0` = 'We, his sworn servants, do his bidding and enforce his iron-rule. Cut off from the energies of his fiery realm, Ragnaros is but a shadow of his true self. However, he has more than enough strength to be your end.      $B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 5012;
UPDATE `npc_text` SET `text0_0` = 'The Melee Target trains Aspirants in both mounted attack and defense.$B$BApproach the Melee Target and strike it with a Thrust attack. The force of the blow often spins the target hard enough to injure you or your mount. This is where defense comes into play.$B$BBe certain to have at least one layer of Defend before attacking the target, and continue to stack and refresh Defend throughout the training exercise. Otherwise, you may well find yourself dismounted.$B$BThe same holds true in actual mounted combat: Balance attack and defense, Thrusting at every opportunity and maintaining your layers of Defend as best you can.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14434;
UPDATE `npc_text` SET `text0_0` = 'Welcome to Booty Bay, partner.  Don''t mind DeMeza and her crew... we let the hellion run riot one day a year, Pirates'' Day, and then she leaves us in peace to go plunder the South Seas again.$B$BNow then... what can this humble servant of the Steamwheedle Cartel do for you?  Better still - what can you do for me, eh?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 13062;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Missing US text',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14330;
UPDATE `npc_text` SET `text0_0` = 'It''s a good thing you guys showed up! The Iron Dwarves have pushed us back to this location, and we''re barely managing to hold the line here. $B$BEven worse, they''ve begun to power up their magical defenses. If we don''t attack soon, they''ll be able to annihilate us in the blink of an eye!$B$BWe''ve managed to rebuild several siege machines, demolishers and motorcycles from the Alliance and Horde expeditions that were here before us. However, all of our pilots died in the last assault.$B$BYou must take the vehicles and storm the gates of Ulduar! $B$BPlease, $n! You''re our last hope!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14369;
UPDATE `npc_text` SET `text0_0` = 'Why you''re just the $c I was looking for! I''m testing a new rocket-powered flying device, and I need your help!$B$BJust take one of these harnesses and put it on under your armor.  Hit the button on the side, and BOOM, off you go.$B$BDon''t go trying to steal my work though. Each of these babies is fitted with a Transponster 8000 linked to the one in my hand. If you get too far from me the Transponster will shut down the main rocket and you''ll be unable to lift off until you return.$B$BNow where did I put those liability forms?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15134;
