UPDATE `npc_text` SET `text0_0` = 'These babies can hurl fire like none other. We''ve even attached a secondary cannon, a grappling hook and added a manual fuel injection system.  If you can obtain liquid pyrite from the mechanognomes, you can use it to hurl high-density explosives, or turbo-boost your movement speed. $B$BLet''s see those Explorer''s League twirps beat that!',`text0_1` = 'These babies can hurl fire like none other. We''ve even attached a secondary cannon, a grappling hook and added a manual fuel injection system.  If you can obtain liquid pyrite from the mechanognomes, you can use it to hurl high-density explosives, or turbo-boost your movement speed. $B$BLet''s see those Explorer''s League twirps beat that!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14368;
