UPDATE `npc_text` SET `text0_0` = 'The pile of skulls reeks of foulness.  You fear the arakkoa have made an addition to the pile fairly recently.$B$BYou will need 10 Time-Lost Scrolls to call forth the descendants of Terokk''s adversaries.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11057;
UPDATE `npc_text` SET `text0_0` = 'The Ashen Verdict is a select group of the most talented craftsmen in the Ebon Blade and Argent Crusade. Its creation symbolizes the unity of our forces as we mount this final assault on the Lich King and his minions.$b$bIt is through the Ashen Verdict''s efforts that we have discovered how to bend primordial saronite to our will.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15159;
UPDATE `npc_text` SET `text0_0` = 'Speak with Alchemist Finklestein, $c. He can set you on the path.$b$bDemonstrate your loyalty and their methods shall be made known to you.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15160;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'I find the ocean floor to be very peaceful.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7917;
UPDATE `npc_text` SET `text0_0` = 'With you and your people as allies, we have decided to stay on this island and rebuild. Elune bless you, hero.$B$BWhile the sadness still comes and goes, I think we will survive.$B',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 8880;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Ohh, thank you soo much for getting me out of that cage because I was in there for soo long and it smelled like minced mutton that had been sitting out in the sun for a week and I don''t like mutton to begin with because when I was little, well littler, I was actually turned into a sheep for a minute and so I know what it feels like to be a sheep and I don''t want someone eating me, especially an overgrown troll dressed up like a kitty....$b$b<Ashli takes a deep breath.>$b$bHow''s my hair?$B',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11582;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'This is incredible! You''re covered in potent, virulent, fantastic blight! Please, allow me to harvest these pristine samples. I will remove any lingering infection from your allies as well, and reward you all for your bravery and self-sacrifice in the name of medicine! Let me know if you are ready to proceed.$B$B[Before proceeding, make sure that ALL raid members are nearby in order for them to receive credit for your accomplishment.]',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15343;
UPDATE `npc_text` SET `text0_0` = 'You can do this alone, you say? Is this simple foolishness or misplaced confidence I see before me?$B$BNo, I can see it in your eyes. You have to know. You have to prove to yourself that you can do this alone. Very well. I will retreat from the battlefield if you so wish it.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15603;
UPDATE `npc_text` SET `text0_0` = 'Amazing!  There are passages in here that I have never seen before.  This must have taken quite a while for you to track down.  If you ever find anymore books like this, I would like to be notified immediately.$B$BPlease take one of my Kirin Tor Familiars with you just in case you stumble across anything.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 14194;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'The Frost Lord, Ahune, must be stopped.$B$BEven now he is taking form, summoned from his elemental prison by the mad cultists of the Twilight''s Hammer.$B$BIf he''s allowed to enter our world completely, he''ll bury us beneath an eternal winter.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15855;
UPDATE `npc_text` SET `text0_0` = 'I''m only here in case someone faints. The new recruits get a little excited and occasionally overexert themselves.$B$B...well, that, and sometimes one of the new mechano-tank prototypes explode. Whoops!',`text0_1` = 'I''m only here in case someone faints. The new recruits get a little excited and occasionally overexert themselves.$B$B...well, that, and sometimes one of the new mechano-tank prototypes explode. Whoops!',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15779;
UPDATE `npc_text` SET `text0_0` = 'I''m tellin'' you, that Corin Direbrew''s a madman.$B$BIt''s not MY fault he didn''t get invited to compete at Brewfest! But that didn''t stop him and all his Dark Iron cronies from roughin'' up my employees and drinking all my brew.$B$BSomeone''s got to put an end to this!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15853;
UPDATE `npc_text` SET `text0_0` = 'Ye''ve got some stones, $glad:lass;, comin'' in here unannounced.$B$BWhat do ye want?',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15858;
UPDATE `npc_text` SET `text0_0` = 'What?!  What did ye say?!  How dare ye!  Me beer can stand up to any of that rot they serve at Brewfest!$B$BYou''ll pay for this insult, $c!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 15859;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = '<Tears stream down Greatmother Geyah''s face.>$B$BI... I... Durotan survived to have a child? The child Draka told me of before they left... It was their greatest fear... To raise a child in this world. On the other side of that gate was their only hope. I dared not tell Durotan, but secretly, I begged the spirits to watch over them - to protect their child and to give them strength.$B$BI... I must see my grandchild. I must see him. Please, I am too weak. You must tell him. Before I leave this world...',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9825;
UPDATE `npc_text` SET `text0_0` = 'Greetings!  I am here to promote a tournament to test your fishing skill in Stranglethorn.  To participate you need enough might to survive there and have enough skill in fishing to coax the fish from the water.$B$B Come back later when you are more qualified!',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 7711;
UPDATE `npc_text` SET `text0_0` = 'We do not know. We believe that the Black dragonflight is involved as are some independent third parties. That is why you are here, <race>. You will unravel this mystery from the inside and bring redemption to Netherwing.$B$BAnd now... I can only assume she asked you to bring back my hand.',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10945;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Forgetting your skill in Potion Mastery is not something to do lightly.$B$BAre you absolutely sure?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11074;
UPDATE `npc_text` SET `text0_0` = 'How did you learn about the ore? Not even the Baron knew...$B$BTake the cursed things. They''ve brought me nothing but misfortune anyway. I hid them IN the stables just off the courtyard.$B$B<A low growl begins TO emanate FROM the back of Landen''s throat.>',`text0_1` = NULL,`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 9068;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'You having a good time here with us in Ogri''la?$B$BWe have a lot of stuff that our ogres are making, day and night.  We save the best to sell to our coolest guests like you!$B$BSo, as you''re out there doing your thing, and making the mountains a safer place, stop by from time to time to see what we have.$B$BGood luck out there, $g man : chicky;.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11029;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Need supplies for the field?',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 11059;
UPDATE `npc_text` SET `text0_0` = NULL,`text0_1` = 'Welcome to Ogri''la, $c.$B$BThe ogres here have managed to gain a great mental acuity through the magical emanations of the surrounding crystals.  Though we do not fully understand how they work, we have come to appreciate our new home and only want to live in peace.$B$BUnfortunate then that the demons and ethereals, and especially the Black Dragonflight, will not leave us to that peace.',`text1_0` = NULL,`text1_1` = NULL,`text2_0` = NULL,`text2_1` = NULL,`text3_0` = NULL WHERE `ID` = 10926;

