REPLACE INTO `page_text` (`entry`, `text`, `next_page`) VALUES
('3623', 'She plucked the tiny bag from his hands, excitedly pulling it open and revealing a citrine pendant.$B$B"Oh... Marcus, you shouldn''t have."$B$BThe usual teasing was gone from his voice, "Every facet lights the sky, and my heart, with your beautiful reflection."$B$BSoola frowned. "Uh... no. I meant you really shouldn''t have. I could craft something better by accident."$B$BFor the first time, possibly ever, Marcus looked hurt. His shoulders slumped slightly, the %^&*y, ever-present grin missing from his handsome face.$B$BSoola opened her mouth to speak, smiling warmly; a glowing rune appeared above her eyes. "I don''t think I can mend your feelings, even with my gift."', '3624'),
('3624', 'Despite the statement, her words seemed to do the trick, Marcus smirked roguishly as he adjusted his leg plates, "Well you aren''t the only gifted one."$B$BSilence penetrated the room with palpable force as the conversation shifted to the language shared by all races of Azeroth.$B$BMinutes became hours, until their passionate dialog was interrupted by lightning streaking from the cloudless sky, thunderously slamming into the lake''s surface and bathing them in steam.$B$B"Is something wrong?", Marcus asked.$B$B"No my Marcus, you''re just off to a great start."$B$BThe remaining pages have been thoroughly destroyed by the elements.', '0');
