REPLACE INTO `dbscript_string` (`entry`, `content_default`, `sound`, `type`, `language`, `emote`) VALUES 
(2000003199, '%s falls silent and a quiet tension falls over the nearby Sha\'tar forces as Xi\'ri makes his decision.', 0, 2, 0, 0),
(2000003201, 'Now is the time, Maiev! Unleash your wrath!', 11394, 6, 0, 0),
(2000003200, 'I\'ve waited for this moment for years. Illidan and his lapdogs will be destroyed!', 11499, 6, 0, 0),
(2000003202, 'Slay all who see us! Word must not get back to Illidan.', 11393, 6, 0, 0),
(2000003204, '%s slips into the shadows discreetly as Akama\'s attention shifts towards Vagath\'s last words.', 0, 2, 0, 0),
(2000003205, 'Akama has no master. Not anymore.', 11395, 0, 0, 0),
(2000003207, 'Our plans are in danger already. It appears Maiev\'s decided to do things her own way.', 0, 0, 0, 0),
(2000003208, '%s\'s attention shifts to a crack along the temple\'s southern wall.', 0, 2, 0, 0),
(2000003209, 'We must carry on with or without Maiev. Inside! Quickly!', 0, 0, 0, 0),
(2000003210, 'A miserable defense from Light-swollen fools. Xi\'ri, I will consume you myself!', 0, 1, 0, 0),
(2000003211, 'Let\'s see how you enjoy that mechanical abomination knocking on your door, Illidan!', 0, 1, 0, 0),
(2000003212, 'The Legion\'s machinations are truly intimidating!', 0, 1, 0, 0),
(2000003213, 'The Legion\'s creations truly grow more foul by the day.', 0, 1, 0, 0),
(2000003214, 'What is that thing?', 0, 1, 0, 0),
(2000003215, 'Inside, quickly! Let\'s use the Legion\'s attack as a distraction!', 0, 1, 0, 0);
