REPLACE INTO `dbscript_string` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `sound`, `type`, `language`, `emote`, `comment`) VALUES
(2000003220, 'Here we have the Cathedral of Light, the center of spiritual enlightenment here in Stormwind.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, NULL),
(2000003221, 'Yes, that is true. Paladins and Priests alike train their skills and research great truths behind the walls of the Cathedral.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, NULL),
(2000003222, 'Children if you would please follow me, we will now be going to see the keep where King Anduin Wrynn himself sits on this throne.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, NULL),
(2000003223, 'Here we have Stormwind Keep. Built upon the ruins of Stormwind Castle, which was destroyed by the Horde in the first Great War.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL),
(2000003224, 'When the Horde was shattered, men returned here and began to rebuild the once great city as a testament to our own survival.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL),
(2000003225, 'Yes, well...let''s head on to the monument dedicated to the heroes of the two Great Wars, the Valley of Heroes. Follow Me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, NULL),
(2000003226, 'Isn''t it amazing, children? All who enter the city must walk beneath the watchful eyes of the greatest heroes of our lands.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL),
(2000003227, 'Breathtaking. Children, when we return to the school, you will each give an oral report on one of these legendary people.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL),
(2000003228, 'Now, take another long look before we make our way to the Holy District and the great Cathedral of Light.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, NULL);
