INSERT INTO `dbscript_string` (`entry`, `content_default`, `sound`, `type`, `language`, `emote`, `comment`) VALUES
(2000003257, 'You filthy little beings need to work faster!', 0, 0, 0, 1, 'Vashj''ir Honor Guard - discipline Technicians 1'),
(2000003256, 'FASTER!!!!', 0, 0, 0, 15, 'Vashj''ir Honor Guard - discipline Technicians 2'),
(2000020043, 'What''s on your mind, sir?', 0, 0, 0, 1, 'Coilfang Priestess/Shatterer - greet Vashj''r Honor Guard'),
(2000003255, 'We will be at capacity soon enough.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003254, 'Soon all of Draenor''s water will be ours.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003253, 'The reservoir fills nicely.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003252, 'We appear to be on target.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003251, 'Purification seems to be ahead of schedule.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003250, 'Things are proceeding as planned.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003249, 'The pumps are working magnificently.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003248, 'If we can keep working at this rate, the Lady will be pleased.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 1'),
(2000003247, 'I couldn''t agree more.', 0, 0, 0, 1, 'Coilfang Priestess/Shatterer - response 1'),
(2000003246, 'You speak the truth.', 0, 0, 0, 1, 'Coilfang Priestess/Shatterer - response 1'),
(2000003245, 'My thoughts exactly.', 0, 0, 0, 1, 'Coilfang Priestess/Shatterer - response 1'),
(2000003244, 'It''s as if you were reading my mind.', 0, 0, 0, 1, 'Coilfang Priestess/Shatterer - response 1'),
(2000003243, 'Don''t let the levels get too low.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003242, 'Direct the flow from the western bog.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003241, 'Keep regulating the main valve to ensure steady flow.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003240, 'Open the purification valves and continue work.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003239, 'Don''t take your eyes off of these filthy Broken. I don''t trust them.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003238, 'Keep everyone working efficiently.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003237, 'Make sure these Broken are thoroughly cleaned before touching the water.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003236, 'Keep ample pressure on the southern pump.', 0, 0, 0, 1, 'Vashj''ir Honor Guard - response 2'),
(2000003235, 'Be wary of intruders.', 0, 0, 0, 1, 'Coilfang Fathom-Witch - say to Coilfang Serpentguard'),
(2000003234, 'Stay alert!', 0, 0, 0, 1, 'Coilfang Fathom-Witch - say to Coilfang Serpentguard'),
(2000003206, 'We must not fail the master.', 0, 0, 0, 1, 'Coilfang Fathom-Witch - say to Coilfang Serpentguard'),
(2000003203, 'Understood.', 0, 0, 0, 1, 'Coilfang Serpentguard - respond to Coilfang Fathom-Witch'),
(2000001027, 'We will not fail.', 0, 0, 0, 1, 'Coilfang Serpentguard - respond to Coilfang Fathom-Witch'),
(2000001026, 'The naga came close to breaking my will... but the secret is still safe, thanks to you.', 0, 0, 0, 1, 'Seer Olum - freed');
