REPLACE INTO `dbscript_string` (`entry`, `content_default`, `language`, `comment`) VALUES
(2000000172, 'And that''s how Lothar killed thirty six orcs with his bare hands!', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 149)'),
(2000003280, 'And so the knights stood before the charging Horde and held their ground as a thousand berserk orcs came through the valley.', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 150)'),
(2000000167, 'They say he can turn into a raven sometimes.', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 151)'),
(2000000170, 'You know why orc eyes glow red? It''s because they drink blood!', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 152)'),
(2000003281, 'There is no spoon.', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 153)'),
(2000000169, 'I swear, people have actually seen them. Pandaren really do exist!', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 154)'),
(2000000168, 'And then the rabbit just bit his head off... I swear.', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 155)'),
(2000003282, 'You know there are crocolisks in the Canals. They were brought from the swamp as pets, but got thrown in the canals.', 7, 'Justin 1368 - Random Texts (Broadcast Text ID 156)'),
(2000000179, 'Really?', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 147)'),
(2000000180, 'Wow.', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 157)'),
(2000003283, 'Oh yeah, I heard about that.', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 158)'),
(2000003284, 'Oh c''mon, that''s not true.', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 166)'),
(2000000182, 'That''s neat.', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 167)'),
(2000000181, 'My father says that''s just a story.', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 168)'),
(2000000178, 'Can you imagine?', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 169)'),
(2000003285, 'Sounds kinda like one of Billy''s fish stories to me.', 7, 'Brandon 1370 - Random Texts (Broadcast Text ID 170)'),
(2000003286, 'I thought I heard something.', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 171)'),
(2000000175, 'I think I see something.', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 172)'),
(2000000173, 'Eww... that''s not a fish!', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 173)'),
(2000000174, 'I got worm guts on my shoes.', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 174)'),
(2000003287, 'Something smells funny.', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 175)'),
(2000000176, 'I hope that was a fish!', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 176)'),
(2000000171, 'I don''t think there''s any fish in these canals.', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 177)'),
(2000000177, 'Worm goes on the hook, hook goes in the water. Fish is in the water, our fish.', 7, 'Roman 1371 - Random Texts (Broadcast Text ID 178)');
